(146, '_transient_feed_0d2db5fea5a8633b56992c916819b198', 'a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:49:\"\n	\n	\n	\n	\n	\n	\n	\n	\n	\n	\n		\n		\n		\n		\n		\n		\n		\n		\n		\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"Blog | WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"https://fr.wordpress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:13:\"lastBuildDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Apr 2021 15:39:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"fr-FR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"generator\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://wordpress.org/?v=5.8-alpha-50786\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:10:{i:0;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"Le 30 avril 2021, rejoignez-nous pour un nouveau WordPress Translation Day FR !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Apr 2021 10:33:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2028\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:372:\"Les WordCamps et Meetups ne sont toujours pas à l&#8217;ordre du jour… mais la communauté WordPress s&#8217;organise&#160;! Cette année, les équipes de traduction et de documentation de WP en français vous proposent de participer à un nouveau WordPress Translation Day FR en ligne le vendredi 30 avril 2021. Cet évènement se déroulera donc le vendredi [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2462:\"\n<p>Les WordCamps et Meetups ne sont toujours pas à l&rsquo;ordre du jour… mais la communauté WordPress s&rsquo;organise&nbsp;!</p>\n\n\n\n<p>Cette année, les équipes de traduction et de documentation de WP en français vous proposent de participer à un nouveau WordPress Translation Day FR en ligne le vendredi 30 avril 2021.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1.png\"><img loading=\"lazy\" width=\"1024\" height=\"487\" src=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-1024x487.png\" alt=\"\" class=\"wp-image-2038\" srcset=\"https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-1024x487.png 1024w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-300x143.png 300w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1-768x365.png 768w, https://fr.wordpress.org/files/2021/04/wp-translation-day-fr-avril-2021-1.png 1467w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Cet évènement se déroulera donc le vendredi 30 avril de 14h à 18h, en visioconférence via Zoom.</p>\n\n\n\n<p>Durant cette après-midi 4 GTE (<em>General Translation Editors</em>) seront présents pour vous aider (<a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profile.wordpress.org/fxbenard\">FX Bénard</a>, <a href=\"https://profile.wordpress.org/wolforg\">Didier Wolforg</a> et <a href=\"https://profile.wordpress.org/audrasjb\">Jb Audras</a>) ainsi que les responsables de la documentation de WordPress en français (<a href=\"https://profile.wordpress.org/chaton666\">Marie Comet</a> et <a href=\"https://profile.wordpress.org/jdy68\">Jenny Dupuy</a>).</p>\n\n\n\n<p>L’objectif est d’accueillir, orienter et accompagner un maximum de nouvelles personnes pour les initier à la traduction du cœur de WordPress, mais aussi des thèmes, des extensions et de la documentation relative au fonctionnement de ce CMS.</p>\n\n\n\n<p>Tout au long de l’après-midi nous accueillerons les personnes désireuses de participer et si besoin, nous organiserons des mini-formations pour aider les personnes débutantes.</p>\n\n\n\n<p>Nous vous attendons nombreuses et nombreux ! Alors rendez-vous sur le Slack de la communauté WordPress-fr&nbsp;:&nbsp;<a href=\"https://wpfr.net/slack/\">https://wpfr.net/slack/</a>&nbsp;puis dans le canal&nbsp;<strong>#wptranslationday</strong></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"https://fr.wordpress.org/2021/04/09/le-30-avril-2021-rejoignez-nous-pour-un-nouveau-wordpress-translation-day-fr/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:74:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"WordPress 5.7 « Esperanza »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://fr.wordpress.org/2021/03/09/wordpress-5-7-esperanza/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://fr.wordpress.org/2021/03/09/wordpress-5-7-esperanza/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Mar 2021 21:42:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1996\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:409:\"Souhaitez la bienvenue à «&#160;Esperanza&#160;», la première version de WordPress de l&#8217;année 2021. Elle a été nommée ainsi en l&#8217;honneur de la bassiste de jazz Esperanza Spalding. Son chemin de musicienne est varié et inspirant — apprenez-en plus sur elle&#160;et n’hésitez pas écouter l&#8217;un de ses albums&#160;! Avec cette nouvelle version, WordPress vous propose de [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:60:\"https://s.w.org/images/core/5.7/about-57-drag-drop-image.mp4\";s:6:\"length\";s:6:\"183815\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:45063:\"\n<div class=\"wp-block-cover\" style=\"background-color:#0a5b89\"><img loading=\"lazy\" width=\"1000\" height=\"517\" class=\"wp-block-cover__image-background wp-image-1997\" alt=\"\" src=\"https://fr.wordpress.org/files/2021/03/about-header-brushes.png\" style=\"object-position:52% 67%\" data-object-fit=\"cover\" data-object-position=\"52% 67%\" srcset=\"https://fr.wordpress.org/files/2021/03/about-header-brushes.png 1000w, https://fr.wordpress.org/files/2021/03/about-header-brushes-300x155.png 300w, https://fr.wordpress.org/files/2021/03/about-header-brushes-768x397.png 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" /><div class=\"wp-block-cover__inner-container\">\n<p class=\"has-text-align-center has-large-font-size\"><strong>WordPress&nbsp;5.7</strong> <br><strong><em>«&nbsp;Esperanza&nbsp;»</em></strong></p>\n\n\n\n<p>Rafraîchissement des couleurs de l&rsquo;administration, simplifications des interactions dans l’éditeur, des outils placés là où vous en avez besoin, WordPress&nbsp;5.7 vous permet de vous concentrer sur le contenu que vous créez.</p>\n\n\n\n<div style=\"height:220px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n</div></div>\n\n\n\n<p>Souhaitez la bienvenue à «&nbsp;Esperanza&nbsp;», la première version de WordPress de l&rsquo;année 2021. Elle a été nommée ainsi en l&rsquo;honneur de la bassiste de jazz Esperanza Spalding. Son chemin de musicienne est varié et inspirant — <a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://en.wikipedia.org/wiki/Esperanza_Spalding\">apprenez-en plus sur elle</a>&nbsp;et n’hésitez pas écouter l&rsquo;un de ses albums&nbsp;!</p>\n\n\n\n<p>Avec cette nouvelle version, WordPress vous propose de nouvelles couleurs et son éditeur vous aidera à accomplir des actions que vous ne pouviez pas envisager auparavant — du moins, pas sans écrire du code ou engager un pro. Les réglages que vous utilisez le plus souvent, comme celui de la taille des caractères, sont présents sur davantage de blocs. Et des modifications de mise en page telles que le passage des images en pleine hauteur deviennent enfin plus simples à réaliser.</p>\n\n\n\n<span id=\"more-1996\"></span>\n\n\n\n<h2>Maintenant, l’éditeur est plus simple à utiliser</h2>\n\n\n\n<p><strong>Plus d’endroits pour gérer la taille des polices&nbsp;:</strong>&nbsp;les contrôles de la taille des polices sont maintenant disponibles là où vous en avez besoin, notamment sur les blocs liste et code. Plus besoin de se rendre sur un autre écran pour effectuer cette simple modification&nbsp;!</p>\n\n\n\n<p><strong><strong>Blocs réutilisables&nbsp;:</strong>&nbsp;</strong>plusieurs améliorations rendent les blocs réutilisables plus stables et plus faciles à utiliser. Et maintenant, ils s’enregistrent automatiquement lorsque vous sauvegardez une publication.</p>\n\n\n\n<p><strong>Outil d’insertion de blocs en glisser-déposer&nbsp;:</strong>&nbsp;glissez les blocs et les compositions de blocs de l’outil d’insertion directement dans votre publication.</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://s.w.org/images/core/5.7/about-57-drag-drop-image.mp4\"></video></figure>\n\n\n\n<h2>Vous pouvez faire plus, sans écrire la moindre ligne de code</h2>\n\n\n\n<p><strong>Alignement en hauteur&nbsp;:</strong>&nbsp;avez-vous déjà voulu donner au bloc bannière une hauteur égale à la hauteur de la fenêtre&nbsp;? Maintenant, vous pouvez.</p>\n\n\n\n<p><strong>Bloc Boutons&nbsp;:</strong>&nbsp;vous pouvez désormais choisir entre une disposition verticale ou horizontale des boutons. Et vous pouvez régler la largeur des boutons à un pourcentage prédéfini.</p>\n\n\n\n<p><strong>Bloc d’icônes de réseaux sociaux&nbsp;:</strong>&nbsp;vous pouvez maintenant modifier la taille des icônes.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://s.w.org/images/core/5.7/about-57-cover.jpg\" alt=\"\" /></figure>\n\n\n\n<h2>Simplification de la palette de couleurs par défaut</h2>\n\n\n\n<p>Cette nouvelle palette de couleurs simplifiée réduit le nombre de couleurs qui se trouvaient auparavant dans le cœur de WordPress à sept couleurs principales et un jeu de 56 nuances conformes au rapport de contraste&nbsp;<a href=\"https://www.w3.org/WAI/WCAG2AAA-Conformance\">WCAG 2.0 AA recommandé</a>.</p>\n\n\n\n<p>En terme de perception, les variations de couleurs sont uniformes du clair au foncé dans chaque gamme de couleur ce qui signifie qu’elles vont du plus clair vers le plus foncé avec les mêmes paliers.</p>\n\n\n\n<p>La moitié de la gamme de couleurs a un rapport de contraste de 4,5 ou plus par rapport au noir, et l’autre moitié propose le même rapport de contraste par rapport au blanc.</p>\n\n\n\n<p>Vous découvrirez cette nouvelle palette de couleurs par défaut sur votre tableau de bord WordPress. Si vous créez des thèmes, des extensions ou tout autre composant, pensez à l’utiliser. Pour plus de détails,&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/23/standardization-of-wp-admin-colors-in-wordpress-5-7\">consultez la note de développement concernant cette palette de couleurs (en anglais)</a>.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/03/frise-color-wp57.png\"><img loading=\"lazy\" width=\"1024\" height=\"20\" src=\"https://fr.wordpress.org/files/2021/03/frise-color-wp57-1024x20.png\" alt=\"\" class=\"wp-image-2008\" srcset=\"https://fr.wordpress.org/files/2021/03/frise-color-wp57-1024x20.png 1024w, https://fr.wordpress.org/files/2021/03/frise-color-wp57-300x6.png 300w, https://fr.wordpress.org/files/2021/03/frise-color-wp57-768x15.png 768w, https://fr.wordpress.org/files/2021/03/frise-color-wp57-1536x30.png 1536w, https://fr.wordpress.org/files/2021/03/frise-color-wp57.png 1808w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<h3>De HTTP à HTTPS en un clic</h3>\n\n\n\n<p>Le passage d’un site de HTTP à HTTPS se fait maintenant en un clic. WordPress mettra automatiquement à jour les URL en base de données lorsque vous passerez au HTTPS. Ne perdez plus votre temps à chercher les URL à modifier&nbsp;!</p>\n\n\n\n<h3>Nouvelle API Robots</h3>\n\n\n\n<p>La nouvelle API Robots vous permet d’inclure des directives de filtrage dans la balise méta «&nbsp;robots&nbsp;», et l’API intègre par défaut la directive&nbsp;<code>max-image-preview: large</code>. Cela signifie que les moteurs de recherche peuvent maintenant afficher de plus grandes images de prévisualisation (à moins que le site ne soit pas public), ce qui peut améliorer votre trafic.</p>\n\n\n\n<h3>Poursuite du nettoyage nécessaire après la mise à jour vers jQuery 3.5.1</h3>\n\n\n\n<p>Pendant des années, jQuery a aidé à animer les choses à l’écran de façon très efficace — mais les choses évoluent sans cesse, et jQuery n’est pas en reste.</p>\n\n\n\n<p>Avec WP&nbsp;5.7, jQuery devient moins intrusif et retourne moins de messages dans la console de votre navigateur.</p>\n\n\n\n<h3>Chargez vos iframes en différé</h3>\n\n\n\n<p>Dorénavant, les iframes pourront se charger en différé. Par défaut, WordPress ajoutera un attribut&nbsp;<code>loading=\"lazy\"</code>&nbsp;aux balises iframe lorsque leur largeur et leur hauteur seront spécifiées.</p>\n\n\n\n<h3>Consultez le guide technique de la version pour en savoir plus&nbsp;!</h3>\n\n\n\n<p>Consultez le guide des changements techniques de WordPress&nbsp;5.7. Il met en avant les notes de développement pour chaque modification que vous souhaiteriez approfondir&nbsp;:&nbsp;<a href=\"https://fr.wordpress.org/2021/02/24/les-changements-techniques-a-venir-sur-wordpress-5-7/\">guide des changements techniques de WordPress 5.7</a></p>\n\n\n\n<h2>L&rsquo;équipe de direction de WordPress 5.7</h2>\n\n\n\n<p>La version 5.7 de WordPress a été dirigée par une équipe réduite mais expérimentée&nbsp;:</p>\n\n\n\n<ul><li><strong>Responsable de la version&nbsp;:</strong>&nbsp;Matt Mullenweg (<a href=\'https://profiles.wordpress.org/matt/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>matt</a>)</li><li><strong>Coordinatrice de la version&nbsp;:</strong>&nbsp;Ebonie Butler (<a href=\'https://profiles.wordpress.org/metalandcoffee/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>metalandcoffee</a>)</li><li><strong>Responsable des tickets&nbsp;:</strong>&nbsp;Tonya Mork (<a href=\'https://profiles.wordpress.org/hellofromtonya/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>hellofromtonya</a>)</li><li><strong style=\", sans-serif\">Responsable technique côté cœur&nbsp;:</strong><span style=\", sans-serif\">&nbsp;Sergey Biryukov (<a href=\'https://profiles.wordpress.org/sergeybiryukov/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>sergeybiryukov</a>)</span></li><li><strong>Responsable technique côté éditeur&nbsp;:</strong>&nbsp;Robert Anderson (<a href=\'https://profiles.wordpress.org/noisysocks/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>noisysocks</a>)</li><li><strong>Responsable du design&nbsp;:</strong>&nbsp;Tim Hengeveld (<a href=\'https://profiles.wordpress.org/hedgefield/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>hedgefield</a>)</li><li><strong>Responsable accessibilité&nbsp;:</strong>&nbsp;Sarah Ricker (@sarahricke<strong>r</strong>)</li><li><strong>Responsable de la documentation&nbsp;:&nbsp;</strong>Jb Audras (<a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a>)</li><li><strong>Responsable des tests&nbsp;:</strong>&nbsp;Monika Rao (<a href=\'https://profiles.wordpress.org/monikarao/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>monikarao</a>)</li></ul>\n\n\n\n<p>Cette version est le résultat du dur labeur de 481 contributrices et contributeurs. Cela représente environ 250 tickets sur Trac et plus de 950 <em>pull requests</em> sur GitHub.</p>\n\n\n\n<p><a href=\"https://profiles.wordp