rofiles.wordpress.org/zieladam/\">zieladam</a>.</p>\n\n\n\n<p><em>Merci <a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a> pour la relecture de ce communiqué.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://fr.wordpress.org/2021/03/09/wordpress-5-7-esperanza/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:74:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"Les changements techniques à venir sur WordPress 5.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://fr.wordpress.org/2021/02/24/les-changements-techniques-a-venir-sur-wordpress-5-7/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://fr.wordpress.org/2021/02/24/les-changements-techniques-a-venir-sur-wordpress-5-7/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Feb 2021 10:04:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1939\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:384:\"Dans ces temps difficiles, WordPress 5.7 vous propose de nouvelles fonctionnalités et des améliorations pour vous aider à démarrer cette année 2021 sur une note positive ! Pour cette nouvelle version de WordPress, une petite équipe – mais expérimentée – a été mise sur pied afin de diriger le développement de cette nouvelle version embarquant un paquet de [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:78:\"https://fr.wordpress.org/files/2021/02/send-password-reset-profile-setting.mp4\";s:6:\"length\";s:6:\"222292\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:31223:\"\n<div class=\"wp-block-group has-background\" style=\"background-color:#0d5a89\"><div class=\"wp-block-group__inner-container\">\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner.png\"><img loading=\"lazy\" width=\"1024\" height=\"458\" src=\"https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner-1024x458.png\" alt=\"\" class=\"wp-image-1940\" srcset=\"https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner-1024x458.png 1024w, https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner-300x134.png 300w, https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner-768x344.png 768w, https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner-1536x688.png 1536w, https://fr.wordpress.org/files/2021/02/wp-5-7-RC1-banner.png 1568w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<div class=\"wp-block-group has-white-color has-text-color\"><div class=\"wp-block-group__inner-container\">\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:2%\">\n<p>&nbsp;</p>\n</div>\n\n\n\n<div class=\"wp-block-column\" style=\"flex-basis:96%\">\n<p class=\"has-normal-font-size\">La sortie de WordPress 5.7 est prévue pour le 9 mars 2021.</p>\n\n\n\n<p class=\"has-small-font-size\">Avec maintenant plus de 40&nbsp;% de parts de marché, le logiciel libre WordPress poursuit son ascension impressionnante au sein de l&rsquo;écosystème des CMS.</p>\n\n\n\n<p class=\"has-small-font-size\">Découvrez dans cet article les nouveautés qui vous attendent pour cette nouvelle version de l’outil de création de sites web le plus populaire au monde&nbsp;!</p>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p style=\"font-size:2px\">&nbsp;</p>\n</div>\n</div>\n</div></div>\n</div></div>\n\n\n\n<span id=\"more-1939\"></span>\n\n\n\n<p>Dans ces temps difficiles, WordPress 5.7 vous propose de nouvelles fonctionnalités et des améliorations pour vous aider à démarrer cette année 2021 sur une note positive ! Pour cette nouvelle version de WordPress, une <a href=\"https://make.wordpress.org/core/2020/12/21/wordpress-5-7-planning-roundup/\">petite équipe – mais expérimentée –</a> a été mise sur pied afin de diriger le développement de cette nouvelle version embarquant un paquet de nouvelles fonctionnalités techniques et des corrections attendues par les développeurs et développeuses.</p>\n\n\n\n<p>En tant qu’utilisatrice ou utilisateur de WordPress, vous retrouverez un éditeur de blocs encore plus efficace, l&rsquo;arrivée du chargement différé des iframes, un outil de migration vous permettant de passer de HTTP à HTTPS en un clic, de nouvelles couleurs standardisées pour l&rsquo;administration de votre site WordPress, une nouvelle API destinée à la gestion des instructions pour les robots d&rsquo;indexation.</p>\n\n\n\n<p>En tant que développeuse ou développeur, vous retrouverez <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.7&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">66 améliorations et nouvelles fonctionnalités</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.7&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">127 corrections de bugs</a>, et bien plus encore&nbsp;! Les personnes qui s&rsquo;intéressent à la technique seront sûrement attentives <a href=\"https://core.trac.wordpress.org/ticket/51812\">à la tâche de nettoyage des erreurs JavaScript qui a été conduite après la mise à niveau vers jQuery 3.5.1 en tant qu’étape 3 de notre processus de mise à niveau de la bibliothèque jQuery</a>.</p>\n\n\n\n<p>Dans ce guide technique, vous trouverez tous les changements qui pourront vous concerner en tant que personne utilisant WordPress au quotidien. Les liens proposés mènent tous à des ressources en anglais.</p>\n\n\n\n<h2>Administration&nbsp;: une nouvelle palette de couleurs standardisée</h2>\n\n\n\n<p>Il s&rsquo;agit de la première partie d&rsquo;un projet plus large visant à nettoyer les feuilles de styles de l&rsquo;administration de WP. Avec WP 5.7, toutes les couleurs déclarées en CSS sont regroupées au sein de l&rsquo;une des 12 variations de bleu, vert, rouge et jaune, ou dans l&rsquo;une des 13 variations de gris, noir et le blanc. Cela peut paraître encore présenter trop de variations, mais il faut savoir qu&rsquo;il y en avait bien plus auparavant, et surtout qu&rsquo;elles n&rsquo;obéissaient pas du tout à des variations strictes et prévisibles.</p>\n\n\n\n<p>La nouvelle palette de couleurs regroupe donc toutes les couleurs du code source de WordPress dans une palette de 56 couleurs qui permettent de satisfaire les ratios de contrastes demandés par les <a href=\"https://www.w3.org/TR/UNDERSTANDING-WCAG20/visual-audio-contrast-contrast.html\">Règles d&rsquo;accessibilités des contenus web (WCAG)</a> au niveau AA entre ces couleurs, et le blanc ou le noir.</p>\n\n\n\n<p>La standardisation de la palette de couleurs de l&rsquo;administration pourra aider les personnes contribuant à WordPress à prendre des décisions de conception accessibles. Les développeuses et développeurs de thèmes sont encouragé·e·s à utiliser cette nouvelle palette de couleurs afin de proposer une meilleur cohérence entre leur produit et le cœur de WordPress.</p>\n\n\n\n<p>Dans la note de développement liée ci-dessous, vous trouverez toutes les indications techniques pour vous permettre de rendre le code de vos développements conforme à la palette de couleurs de l&rsquo;administration de WP.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"1C0xgLs7Cz\"><a href=\"https://make.wordpress.org/core/2021/02/23/standardization-of-wp-admin-colors-in-wordpress-5-7/\">Standardization of WP-Admin colors in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Standardization of WP-Admin colors in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/standardization-of-wp-admin-colors-in-wordpress-5-7/embed/#?secret=1C0xgLs7Cz\" data-secret=\"1C0xgLs7Cz\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>L&rsquo;éditeur de blocs – Gutenberg</h2>\n\n\n\n<p>L&rsquo;éditeur de blocs Gutenberg poursuit ses itérations rapides.&nbsp;La version 9.9 de Gutenberg est pleinement intégrée à  WordPress 5.7, ce qui représente 7 nouvelles versions supplémentaires de Gutenberg (les versions&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/04/whats-new-in-gutenberg-4-november/\">9.3</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">9.4</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/12/02/whats-new-in-gutenberg-2-december/\">9.5</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/12/23/whats-new-in-gutenberg-23-december/\">9.6</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2021/01/07/whats-new-in-gutenberg-6-january/\">9.7</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2021/01/20/whats-new-in-gutenberg-9-8-20-january/\">9.8</a> et&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/05/whats-new-in-gutenberg-9-9-5-february/\">9.9</a>), toutes comprises dans cette nouvelle version de WP. Des correctifs de bogues et des améliorations de performances provenant des versions&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/17/whats-new-in-gutenberg-10-0-february/\">10.0</a>&nbsp;et 10.1 font aussi partie de WP 5.7.</p>\n\n\n\n<p>Il y a un paquet de nouvelles fonctionnalités liées à Gutenberg dans WP 5.7. Citons par exemple le glisser-déposer depuis l&rsquo;outil d&rsquo;insertion de blocs, l&rsquo;alignement en pleine hauteur pour certains blocs, l&rsquo;affichage des variations de styles dans l&rsquo;inspecteur, des améliorations d&rsquo;utilisabilité et de stabilité sur les blocs réutilisables, les alignements verticaux dans les blocs boutons, la possibilité de modifier la taille des icônes dans le bloc icônes de réseaux sociaux, ou encore la possibilité de modifier la taille de police dans les blocs de liste ou d&rsquo;affichage de bouts de code.</p>\n\n\n\n<p>Pour les mises à jour techniques, voici quelques notes de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"J3inin7OuR\"><a href=\"https://make.wordpress.org/core/2021/02/18/wordpress-5-7-a-new-dynamic-hook-to-filter-the-content-of-a-single-block/\">WordPress 5.7: A new dynamic hook to filter the content of a single block</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 5.7: A new dynamic hook to filter the content of a single block&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/18/wordpress-5-7-a-new-dynamic-hook-to-filter-the-content-of-a-single-block/embed/#?secret=J3inin7OuR\" data-secret=\"J3inin7OuR\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"J94wgc0nlt\"><a href=\"https://make.wordpress.org/core/2021/02/22/changes-in-wordpress-data-api/\">Changes in @wordpress/data API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes in @wordpress/data API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/22/changes-in-wordpress-data-api/embed/#?secret=J94wgc0nlt\" data-secret=\"J94wgc0nlt\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cRxoDVWHgL\"><a href=\"https://make.wordpress.org/core/2021/02/22/new-block-variation-apis-in-5-7/\">New block variation APIs in 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New block variation APIs in 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/22/new-block-variation-apis-in-5-7/embed/#?secret=cRxoDVWHgL\" data-secret=\"cRxoDVWHgL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"vc2JDHxqEZ\"><a href=\"https://make.wordpress.org/core/2021/02/23/inner-blocks-api-changes/\">Inner Blocks API Changes</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Inner Blocks API Changes&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/inner-blocks-api-changes/embed/#?secret=vc2JDHxqEZ\" data-secret=\"vc2JDHxqEZ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Y8C8DE5CAV\"><a href=\"https://make.wordpress.org/core/2021/02/23/new-i18n-filters-createi18n-changes/\">New i18n filters &amp; createI18n() changes</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New i18n filters &amp; createI18n() changes&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/new-i18n-filters-createi18n-changes/embed/#?secret=Y8C8DE5CAV\" data-secret=\"Y8C8DE5CAV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Outils d&rsquo;importation et d&rsquo;exportation</h2>\n\n\n\n<p>Plusieurs changements importants impactent les outils d&rsquo;importation et d&rsquo;exportation&nbsp;: un crochet a été créé pour filtrer le titre des publications avant exportation&nbsp;; la date de dernière modification a été ajoutée dans les données d&rsquo;exportation&nbsp;; des améliorations significatives de performances ont été apportées pour une importation plus rapide des menus de navigation. Ces éléments sont détaillés dans la note de développement dédiée&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"VyczrpHE2F\"><a href=\"https://make.wordpress.org/core/2021/02/23/enhancements-to-the-import-export-feature-in-wordpress-5-7/\">Enhancements to the Import/Export feature in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Enhancements to the Import/Export feature in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/enhancements-to-the-import-export-feature-in-wordpress-5-7/embed/#?secret=VyczrpHE2F\" data-secret=\"VyczrpHE2F\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Gestion des médias</h2>\n\n\n\n<p>La principale amélioration concernant les médias est la mise en place du chargement différé par défaut des iframes. Cela fera gagner à votre sites quelques précieux dixièmes de secondes de temps de chargement. D&rsquo;autres changements relatifs à la médiathèque sont listés plus bas dans les améliorations diverses, mais cette nouvelle fonctionnalité méritait sa rubrique dédiée&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"24vK7JdlIB\"><a href=\"https://make.wordpress.org/core/2021/02/19/lazy-loading-iframes-in-5-7/\">Lazy-loading iframes in 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Lazy-loading iframes in 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/19/lazy-loading-iframes-in-5-7/embed/#?secret=24vK7JdlIB\" data-secret=\"24vK7JdlIB\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Gestion des comptes des utilisatrices et utilisateurs de votre site</h2>\n\n\n\n<p>À partir de WordPress 5.7, il est possible pour les administratrices et administrateurs de sites WordPress de générer facilement l&rsquo;envoi de l&rsquo;e-mail de réinitialisation de mot de passe à n&rsquo;importe quel compte déjà inscrit sur le site. Pour cela, il suffit de se rendre sur l&rsquo;écran de modification du compte et de cliquer sur le bouton d&rsquo;envoi de l&rsquo;e-mail contenant le lien de réinitialisation, comme décrit dans cette petite vidéo (montrant l&rsquo;interface en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://fr.wordpress.org/files/2021/02/send-password-reset-profile-setting.mp4\"></video></figure>\n\n\n\n<p>Il est aussi possible d&rsquo;utiliser les liens d&rsquo;accès rapide présents dans la liste des comptes du site sur chaque ligne correspondant à un utilisateur ou une utilisatrice, ou encore d&rsquo;envoyer ce lien de réinitialisation à un grand nombre de comptes en utilisant l&rsquo;outil de traitement par lots. Consultez l&rsquo;article d&rsquo;origine en anglais pour plus de détails&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"V84RfcthGK\"><a href=\"https://make.wordpress.org/core/2021/02/22/send-reset-password-links-in-wordpress-5-7/\">Send reset password links in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Send reset password links in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/22/send-reset-password-links-in-wordpress-5-7/embed/#?secret=V84RfcthGK\" data-secret=\"V84RfcthGK\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>API REST</h2>\n\n\n\n<p>Des modifications ont été apportées à l’API REST, notamment concernant des changements de points de terminaison, des changements de paramètres disponibles ou acceptés, ou encore des changements concernant la gestion des mots de passe d&rsquo;application.</p>\n\n\n\n<p>Ces changements sont récapitulés sur cet article en anglais&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"LkKIGqGLiv\"><a href=\"https://make.wordpress.org/core/2021/02/23/rest-api-changes-in-wordpress-5-7/\">REST API Changes in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;REST API Changes in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/rest-api-changes-in-wordpress-5-7/embed/#?secret=LkKIGqGLiv\" data-secret=\"LkKIGqGLiv\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>API Robots</h2>\n\n\n\n<p>Une nouvelle API fait son arrivée dans WordPress&nbsp;! L’API Robots permet de gérer de façon précise et contrôlée l&rsquo;affichage des balises méta <code>robots</code> sur les pages de votre site. Pour tout savoir sur cette amélioration destinées aux personnes souhaitant optimiser leur site aux petits oignons pour le référencement, consultez cette note de développement&nbsp;: </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Cjzdm2rSaO\"><a href=\"https://make.wordpress.org/core/2021/02/19/robots-api-and-max-image-preview-directive-in-wordpress-5-7/\">Robots API and max-image-preview directive in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Robots API and max-image-preview directive in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/19/robots-api-and-max-image-preview-directive-in-wordpress-5-7/embed/#?secret=Cjzdm2rSaO\" data-secret=\"Cjzdm2rSaO\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Sécurité</h2>\n\n\n\n<p>Pas de correctif de faille de sécurité dans cette version car rappelons-le&nbsp;: ce n&rsquo;est pas le but des versions majeures&nbsp;! Mais en revanche, plusieurs améliorations intéressantes&nbsp;: tout d&rsquo;abord, l&rsquo;outil de contrôle de la santé de votre site (Outils &gt; Santé du site) sera maintenant à même de vérifier si votre site dispose d&rsquo;un certificat SSL (permettant le passage de votre site en HTTPS) et le cas échéant de vous proposer de migrer votre site de HTTP à HTTPS. Il fera également un état des lieux de la migration et vous permettra de corriger les erreurs éventuelles. Enfin, un premier pas vers l&rsquo;intégration des entêtes Content-Security-Policy (CSP) est fait avec la mise en place d&rsquo;outils permettant aux développeurs et développeuses d&rsquo;utiliser des attributs dédiés sur les scripts qu&rsquo;ils et elles ajoutent sur WordPress afin notamment d&rsquo;en vérifier l&rsquo;origine. Pour plus de détails&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"onU2eWtR2Z\"><a href=\"https://make.wordpress.org/core/2021/02/22/improved-https-detection-and-migration-in-wordpress-5-7/\">Improved HTTPS detection and migration in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improved HTTPS detection and migration in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/22/improved-https-detection-and-migration-in-wordpress-5-7/embed/#?secret=onU2eWtR2Z\" data-secret=\"onU2eWtR2Z\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xYibzHZ3Es\"><a href=\"https://make.wordpress.org/core/2021/02/23/introducing-script-attributes-related-functions-in-wordpress-5-7/\">Introducing script attributes related functions in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing script attributes related functions in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/introducing-script-attributes-related-functions-in-wordpress-5-7/embed/#?secret=xYibzHZ3Es\" data-secret=\"xYibzHZ3Es\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres mises à jour techniques de WordPress&nbsp;5.7</h2>\n\n\n\n<p>Des modifications concernant les écrans de connexion et d&rsquo;inscription on également été faites&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SQskB7miUR\"><a href=\"https://make.wordpress.org/core/2021/02/16/login-registration-screens-changes-in-wordpress-5-7/\">Login &amp; registration screens changes in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Login &amp; registration screens changes in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/16/login-registration-screens-changes-in-wordpress-5-7/embed/#?secret=SQskB7miUR\" data-secret=\"SQskB7miUR\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Utile pour les développeuses et développeurs de thèmes, un nouveau marqueur de modèle et un nouveau marqueur conditionnel permettant de récupérer ou tester les publications parentes d&rsquo;une publication donnée&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"5eT1aLYOGx\"><a href=\"https://make.wordpress.org/core/2021/02/10/introducing-new-post-parent-related-functions-in-wordpress-5-7/\">Introducing new Post Parent related functions in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing new Post Parent related functions in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/10/introducing-new-post-parent-related-functions-in-wordpress-5-7/embed/#?secret=5eT1aLYOGx\" data-secret=\"5eT1aLYOGx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Deux nouvelles fonctions ont été ajoutées dans WP 5.7 afin de déterminer si une publication est visualisable publiquement ou non. Le marqueur conditionnel <code>is_post_publicly_viewable()</code> est notamment particulièrement intéressant car il combine plusieurs vérifications en une seule fonction. Pour plus de détails (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"o95wmnzqCC\"><a href=\"https://make.wordpress.org/core/2021/02/18/introducing-additional-functions-to-check-if-a-post-is-publicly-viewable-in-wordpress-5-7/\">Introducing additional functions to check if a post is publicly viewable in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing additional functions to check if a post is publicly viewable in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/18/introducing-additional-functions-to-check-if-a-post-is-publicly-viewable-in-wordpress-5-7/embed/#?secret=o95wmnzqCC\" data-secret=\"o95wmnzqCC\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Pour finir, voici une note de développement contenant pêle-mêle une liste de toutes les petites améliorations notables destinées aux développeuses et développeurs&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"x30T5MYHjK\"><a href=\"https://make.wordpress.org/core/2021/02/23/miscellaneous-developer-focused-changes-in-wordpress-5-7/\">Miscellaneous developer focused changes in WordPress 5.7</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous developer focused changes in WordPress 5.7&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2021/02/23/miscellaneous-developer-focused-changes-in-wordpress-5-7/embed/#?secret=x30T5MYHjK\" data-secret=\"x30T5MYHjK\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Et bien plus encore…</h2>\n\n\n\n<p>WordPress&nbsp;5.7 contient bien d&rsquo;autres améliorations et modifications !<br>Plus de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">127</a>&nbsp;bugs ont été corrigés,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">66</a>&nbsp;améliorations et nouvelles fonctionnalités ont été implémentées et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">29</a>&nbsp;tâches courantes ont été&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">clôturées dans WordPress 5.7</a>. Voici une poignée d&rsquo;autres modifications qui n&rsquo;ont pas été évoquées dans les notes de développement listées ci-dessus&nbsp;:</p>\n\n\n\n<ul><li>Éditeur&nbsp;: prise en charge du filtrage des paramètres dans l&rsquo;enregistrement de nouveaux types de blocs à partir de métadonnées (<a href=\"https://core.trac.wordpress.org/ticket/52138\">#52138</a>)</li><li>Menus&nbsp;: ajout d&rsquo;un pied de section épinglé au gestionnaire d&rsquo;éléments de menus afin d&rsquo;éviter de dupliquer les boutons de sauvegarde (<a href=\"https://core.trac.wordpress.org/ticket/51631\">#51631</a>)</li><li>Mises à jour&nbsp;: affichage du numéro de la version qui sera réinstallée sur le bouton de réinstallation disponible sur la page de mise à jour de WP (<a href=\"https://core.trac.wordpress.org/ticket/51774\">#51774</a>)</li><li>Mises à jour&nbsp;: prise en charge de la valeur <code>development</code>&nbsp;pour la constante&nbsp;<code>WP_AUTO_UPDATE_CORE</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51978\">#51978</a>)</li></ul>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.7 est prévue le 9 mars 2021. Vous pouvez d’ores et déjà la tester en version&nbsp;<em>Release Candidate</em>&nbsp;en installant l’extension officielle&nbsp;<em>WordPress Beta Tester</em>&nbsp;puis en allant dans ses réglages et en cochant la case&nbsp;Beta / Version de développement puis en mettant à jour votre installation de façon classique.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-plugin-directory wp-block-embed-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wUWSt9zkGg\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"« WordPress Beta Tester » &#8212; Plugin Directory\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=wUWSt9zkGg\" data-secret=\"wUWSt9zkGg\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p><em>Merci à <a href=\'https://profiles.wordpress.org/jdy68/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jdy68</a>, <a href=\'https://profiles.wordpress.org/wolforg/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>wolforg</a>, <a href=\'https://profiles.wordpress.org/chaton666/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chaton666</a> et <a href=\'https://profiles.wordpress.org/crash_47/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>crash_47</a> pour leur relecture de ce guide.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://fr.wordpress.org/2021/02/24/les-changements-techniques-a-venir-sur-wordpress-5-7/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordPress 5.6 « Simone »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://fr.wordpress.org/2020/12/09/wordpress-5-6-simone/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://fr.wordpress.org/2020/12/09/wordpress-5-6-simone/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Dec 2020 23:53:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1899\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:398:\"Voici « Simone », la dernière version de WordPress. Nommée en l’honneur de la légendaire interprète de jazz Nina Simone, connue pour des tubes tels que « Feeling Good », « Young, Gifted and Black » ou encore « Four Women ». Lancez quelques-unes de ses chansons phares en fond sonore et découvrez les nouveautés que nous vous avons réservé. Partager vos histoires [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:78679:\"\n<p>Voici « Simone », la dernière version de WordPress. Nommée en l’honneur de la légendaire interprète de jazz Nina Simone, connue pour des tubes tels que <em>« Feeling Good »</em>, <em>« Young, Gifted and Black »</em> ou encore <em>« Four Women »</em>. Lancez quelques-unes de ses <a rel=\"noreferrer noopener\" href=\"https://youtu.be/D5Y11hwjMNs\" target=\"_blank\">chansons phares</a> en fond sonore et découvrez les nouveautés que nous vous avons réservé.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/wordpress-5-6_cover-03.jpg?resize=632%2C633&amp;ssl=1\" alt=\"WordPress 5.6 Simone with a photo of Nina Simone\" class=\"wp-image-9385\" /></figure>\n\n\n\n<span id=\"more-1899\"></span>\n\n\n\n<h3>Partager vos histoires n’a jamais été aussi facile</h3>\n\n\n\n<p>WordPress 5.6 vous apporte de nombreuses façons de donner vie à vos idées. Avec un tout nouveau thème par défaut comme toile vierge, cette version prend en charge une collection de blocs toujours plus grande. Peignez avec des mots, des images, des sons… et des médias embarqués enrichis.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-1.jpeg?resize=632%2C234&amp;ssl=1\" alt=\"colored circles\" class=\"wp-image-9346\" /></figure>\n\n\n\n<h3>Une plus grande flexibilité de mise en page</h3>\n\n\n\n<p>Donnez vie à vos histoires avec encore plus d’outils pour modifier vos mises en page avec ou sans code. Blocs avec une seule colonne, mises en page utilisant des largeurs mixtes et des colonnes, en-têtes en pleine largeur, bannières vidéos… faites de petits changements ou révolutionnez vos mises en page avec la même facilité.</p>\n\n\n\n<h3>Plus de compositions de blocs</h3>\n\n\n\n<p>Les compositions de blocs pré-configurées sur les thèmes facilitent la mise en place de pages standards sur votre site. Testez la force des compositions pour rendre votre flux de travail plus efficace et partagez cela facilement en vous épargnant quelques clics.</p>\n\n\n\n<h3>Un sous-titrage vidéo directement dans l’éditeur</h3>\n\n\n\n<p>Pour vous aider à ajouter des sous-titres ou des légendes à vos vidéos, vous pouvez désormais les téléverser dans vos articles et vos pages. Il est maintenant très simple de rendre vos vidéos accessibles à toute personne ayant besoin ou préférant utiliser des sous-titres.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-2.jpeg?resize=632%2C120&amp;ssl=1\" alt=\"black vertical line\" class=\"wp-image-9347\" /></figure>\n\n\n\n<h2>Twenty Twenty-One est là&nbsp;!</h2>\n\n\n\n<p>Twenty Twenty-One est une toile vierge pour exprimer vos idées, et l’éditeur de blocs sera votre meilleur pinceau. Ce thème est construit pour l’éditeur de blocs et embarque de nouvelles compositions de blocs dédiées. Essayez différentes mises en page en quelques secondes, et laissez le design intemporel de ce thème faire briller vos contenus.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i2.wp.com/wordpress.org/news/files/2020/12/WordPress-5-6-5.jpeg?resize=632%2C231&amp;ssl=1\" alt=\"examples of what WordPress 5.6 could look like\" class=\"wp-image-9348\" /></figure>\n\n\n\n<p>De plus, ce thème par défaut place l’accessibilité au cœur de votre site. Il est conforme aux&nbsp;<a href=\"https://make.wordpress.org/themes/handbook/review/accessibility/\">Règles d’accessibilité de WordPress</a>&nbsp;et à la plupart des règles de standards tels que les&nbsp;<a href=\"https://www.w3.org/WAI/WCAG2AAA-Conformance\">Règles pour l’accessibilité des contenus web (WCAG) 2.1 au niveau AAA</a>. Cela vous aidera à atteindre les plus hauts niveaux des standards internationaux d’accessibilité… dans la mesure où vous créerez des contenus accessibles et où vous choisirez des extensions également accessibles&nbsp;!</p>\n\n\n\n<h3>Un arc-en-ciel de couleurs pastel</h3>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i1.wp.com/wordpress.org/news/files/2020/12/WordPress-5-6-6.jpeg?resize=632%2C631&amp;ssl=1\" alt=\"Examples of block patterns available in select default themes.\" class=\"wp-image-9349\" /></figure>\n\n\n\n<p>Parfait pour la nouvelle année, Twenty Twenty-One vous propose une palette de couleurs pastel présélectionnées, toutes conformes aux normes de contraste AAA. Vous pouvez également choisir votre propre couleur d’arrière-plan pour le thème, et le thème choisit pour vous des couleurs de texte adaptées à l’accessibilité &#8211; automatiquement&nbsp;!</p>\n\n\n\n<p>Besoin de plus de flexibilité que cela&nbsp;? Vous pouvez également choisir votre propre palette de couleurs à partir du sélecteur de couleurs.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress5-6-3.jpeg?resize=632%2C151&amp;ssl=1\" alt=\"colored circles\" class=\"wp-image-9351\" /></figure>\n\n\n\n<h2>Des améliorations pour tout le monde</h2>\n\n\n\n<h3>Extension des mises à jour automatiques</h3>\n\n\n\n<p>Depuis des années, les mises à jour automatiques de WordPress n’étaient accessibles que via un développement spécifique. Maintenant, cette option est disponible directement dans votre tableau de bord. S’il s’agit de votre premier site, les mises à jour automatiques sont déjà en place. Si vous avez mis à jour un site déjà existant alors tout est resté comme avant. L’option d’activation/désactivation des mises à jour automatiques est disponible sur l’écran Tableau de bord &gt; Mises à jour.</p>\n\n\n\n<h3>Modèle de déclaration d’accessibilité</h3>\n\n\n\n<p>Même sans disposer d’une grande expertise à ce sujet, vous pouvez faire connaître les engagements pris par votre site en termes d’accessibilité juste en cliquant sur un bouton. Une nouvelle&nbsp;<a href=\"https://github.com/10degrees/accessibility-statement-plugin\">extension de fonctionnalités</a>&nbsp;comprend un modèle de texte que vous n’avez qu’à réadapter et à publier. Il a été écrit pour prendre en charge différents contextes et juridictions.</p>\n\n\n\n<h3>Des compositions de blocs intégrées</h3>\n\n\n\n<p>Si vous n’avez pas encore eu l’occasion de jouer avec les compositions de blocs, sachez que tous les thèmes natifs comprennent maintenant une sélection de compositions de blocs qui vous permet de créer des mises en pages complexes. Ces compositions peuvent être personnalisées à votre gré avec les textes, images ou couleurs qui conviennent à votre contenu ou à votre image de marque.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2020/12/WordPress-5-6-4.jpeg?resize=632%2C185&amp;ssl=1\" alt=\"colored and textured rectangles\" class=\"wp-image-9352\" /></figure>\n\n\n\n<h2>Pour les développeurs et les développeuses</h2>\n\n\n\n<h3>Authentification sur l’API REST avec les mots de passe d’application</h3>\n\n\n\n<p>Grâce à la nouvelle API de mots de passe d’application, les applications tierces peuvent se connecter de façon transparente et sécurisée à votre site. Cette nouvelle fonctionnalité de l’API REST vous permet de surveiller les applications qui se connectent à votre site et de contrôler ce qu’elles font.</p>\n\n\n\n<h3>Une meilleure prise en charge de PHP&nbsp;8</h3>\n\n\n\n<p>WordPress 5.6 marque le premier pas vers la prise en charge de PHP&nbsp;8 par WordPress. Il est grand temps de commencer à planifier la façon dont vos produits, services et sites tournant sur WordPress prennent en charge la dernière version de PHP. Pour plus d’information, lisez&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\">la note de développement concernant PHP&nbsp;8 (en anglais)</a>.</p>\n\n\n\n<h3>jQuery</h3>\n\n\n\n<p>La mise à jour de la bibliothèque jQuery se déroule sur trois versions de WordPress&nbsp;: 5.5, 5.6 et 5.7. Comme nous arrivons à mi-chemin du processus, vous pouvez lancer&nbsp;<a href=\"https://fr.wordpress.org/plugins/wp-jquery-update-test/\">l’extension de test de mise à jour</a>&nbsp;pour vérifier par avance d’éventuelles erreurs sur vos sites.</p>\n\n\n\n<p>Si vous rencontrez des problèmes d’affichage sur votre site (ex&nbsp;: un diaporama qui ne fonctionne plus, un bouton qui n’a aucun effet), installez&nbsp;<a href=\"https://fr.wordpress.org/plugins/enable-jquery-migrate-helper/\">l’extension jQuery Migrate</a>.</p>\n\n\n\n<p>Nous vous recommandons également la lecture de <a href=\"https://fr.wordpress.org/2020/12/07/gestion-des-problemes-potentiels-lies-a-la-mise-a-jour-de-jquery-dans-wordpress-5-6/\" data-type=\"post\" data-id=\"1835\">cet article complet en français concernant les changements sur jQuery sur WordPress 5.6</a> et comment les gérer en tant que responsable d&rsquo;un site internet WordPress.</p>\n\n\n\n<h3>Consultez le guide de la version pour en savoir plus</h3>\n\n\n\n<p>Consultez le guide des changements techniques de WordPress 5.6. Il met en avant les notes de développement de chaque modification que vous souhaiteriez connaître&nbsp;:&nbsp;<a href=\"https://fr.wordpress.org/2020/11/24/les-changements-techniques-a-venir-sur-wordpress-5-6/\" data-type=\"post\" data-id=\"1766\">Guide des changements techniques de WordPress 5.6</a>.</p>\n\n\n\n<h3>Changements dans la traduction de WordPress en français</h3>\n\n\n\n<p>La traduction de WordPress en français devient plus inclusive&nbsp;! Consultez les <a href=\"https://fr.wordpress.org/2020/11/26/wordpress-5-6-des-changements-visant-a-ameliorer-linclusivite-de-linterface-dadministration/\" data-type=\"post\" data-id=\"1801\">détails de ces changements de traduction visant à rendre WordPress plus inclusif sur notre article dédié</a>.</p>\n\n\n\n<figure class=\"wp-block-pullquote\"><blockquote><p>It’s a new day, it’s a new life for me<br>…and I’m feeling good.</p><cite>~Nina Simone</cite></blockquote></figure>\n\n\n\n<h2>L’équipe de direction de WordPress&nbsp;5.6 «&nbsp;Simone&nbsp;»</h2>\n\n\n\n<p>Pour la première fois dans l&rsquo;écosystème WordPress, cette version majeure a été dirigée par une équipe 100&nbsp;% féminine&nbsp;: </p>\n\n\n\n<ul><li><strong>Direction&nbsp;:</strong> Josepha Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\">@chanthaboune</a>). Aidée de Chloé Bringmann (<a href=\"https://profiles.wordpress.org/cbringmann/\">@cbringmann</a>) et Angela Jin (<a href=\"https://profiles.wordpress.org/angelasjin/\">@angelasjin</a>).</li><li><strong>Coordination&nbsp;:</strong> Dee Teal (<a href=\"https://profiles.wordpress.org/thewebprincess/\">@thewebprincess</a>).&nbsp;Aidée de Thelma Mutete (<a href=\"https://profiles.wordpress.org/thelmachido/\">@thelmachido</a>) et Laura Nelson (<a href=\"https://profiles.wordpress.org/laurora/\">@laurora</a>).</li><li><strong>Suivi&nbsp;:</strong> Tonya Mork (<a href=\"https://profiles.wordpress.org/hellofromtonya/\">@hellofromtonya</a>).&nbsp;</li><li><strong>Direction technique du cœur WP&nbsp;:</strong> Helen Hou-Sandì (<a href=\"https://profiles.wordpress.org/helen/\">@helen</a>).&nbsp;Aidée de Amy Kamala (<a href=\"https://profiles.wordpress.org/amykamala/\">@amykamala</a>) et Ebonie Butler (<a href=\"https://profiles.wordpress.org/metalandcoffee/\">@metalandcoffee</a>).</li><li><strong>Direction technique de l’éditeur Gutenberg&nbsp;:</strong> Isabel Brison (<a href=\"https://profiles.wordpress.org/isabel_brison/\">@isabel_brison</a>).&nbsp;Aidée de Chandrika Guntur (<a h