on666\">Marie Comet</a>,&nbsp;<a href=\"https://profiles.wordpress.org/maximejobin\">Maxime Jobin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/maxpertici\">Maxime Pertici</a>,&nbsp;<a href=\"https://profiles.wordpress.org/momo-fr\">momo-fr</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nicolasricher\">Nicolas Richer</a>,&nbsp;<a href=\"https://profiles.wordpress.org/papicx\">papicx</a>,&nbsp;<a href=\"https://profiles.wordpress.org/casiepa\">Pascal Casier</a>,&nbsp;<a href=\"https://profiles.wordpress.org/pixxxel\">Pierre Bichet</a>,&nbsp;<a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sebastienserre\">Sébastien SERRE</a>,&nbsp;<a href=\"https://profiles.wordpress.org/crash_47\">Thomas Piron</a>,&nbsp;<a href=\"https://profiles.wordpress.org/spaceshipone\">Timothée Brosille</a>,&nbsp;<a href=\"https://profiles.wordpress.org/translationsbyautomattic\">Translations by Automattic</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/wptranslationsorg\">WP-Translations</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://fr.wordpress.org/2020/12/09/wordpress-5-6-simone/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"Gestion des problèmes potentiels liés à la mise à jour de jQuery dans WordPress 5.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:120:\"https://fr.wordpress.org/2020/12/07/gestion-des-problemes-potentiels-lies-a-la-mise-a-jour-de-jquery-dans-wordpress-5-6/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:129:\"https://fr.wordpress.org/2020/12/07/gestion-des-problemes-potentiels-lies-a-la-mise-a-jour-de-jquery-dans-wordpress-5-6/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 07 Dec 2020 16:29:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1835\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:350:\"En août 2020, WordPress 5.5 a cessé d&#8217;utiliser le script jQuery Migrate par défaut. Avec la sortie prochaine de WordPress 5.6, la version embarquée de jQuery sera mise à jour de la version 1.12.4-wp à la version 3.5.1. Il est important de préciser que cette mise à jour de jQuery est aujourd&#8217;hui indispensable, car cette [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Justin Ahinon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:14872:\"\n<p>En août 2020, WordPress 5.5 a cessé d&rsquo;utiliser le script jQuery Migrate par défaut. <strong>Avec la sortie prochaine de WordPress 5.6, la version embarquée de jQuery sera mise à jour de la version <code>1.12.4-wp</code> à la version <code>3.5.1</code>.</strong></p>\n\n\n\n<p>Il est important de préciser que cette mise à jour de jQuery est aujourd&rsquo;hui indispensable, car cette ancienne version n&rsquo;est plus prise en charge par jQuery et la conserver pose des problèmes de sécurité sur le long terme.</p>\n\n\n\n<p>Dans cet article, vous trouverez l&rsquo;ensemble des préconisations pour réduire au maximum les risques lors de la mise à jour de votre site vers WordPress 5.6 et sa nouvelle version de jQuery.</p>\n\n\n\n<span id=\"more-1835\"></span>\n\n\n\n<p>Ainsi, avec la mise à jour majeure WordPress 5.6, qui elle-même met à jour la version de jQuery, certaines extensions ou certains thèmes qui s&rsquo;appuient sur du code jQuery obsolète risquent de présenter des problèmes, allant de simples avertissement affichés uniquement sur la console du navigateur à des problèmes plus graves pouvant générer des erreurs fatales d&rsquo;exécution du code JavaScript.</p>\n\n\n\n<h2>La solution utilisée lors de la sortie de WordPress 5.5</h2>\n\n\n\n<p>Pour la sortie de WordPress 5.5, l’extension <a href=\"https://fr.wordpress.org/plugins/enable-jquery-migrate-helper/\">Enable jQuery Migrate Helper</a> a été publiée sur le répertoire officiel des extensions WordPress. Elle permettait de réactiver le script jQuery Migrate et de mettre en évidence les éléments à corriger sur l&rsquo;interface d&rsquo;administration de WordPress.</p>\n\n\n\n<p>Initialement, cette extension devait être une solution temporaire pour donner aux personnes développant des extensions ou des thèmes un peu plus de temps pour faire les mises à jour au cas où les changements de la version 5.5 les prendraient au dépourvu.</p>\n\n\n\n<p>Malheureusement, de nombreuses extensions et thèmes (au moment de la publication de cet article, avant la sortie de WordPress 5.6) présents sur le répertoire officiel WordPress.org sont encore basés sur un code obsolète, sans parler des extensions et thèmes payants proposés sur les places de marché premium.</p>\n\n\n\n<p>Cette extension est donc encore massivement utilisée dans l&rsquo;écosystème.</p>\n\n\n\n<h2>Anticiper les problèmes de compatibilité jQuery pour WordPress 5.6</h2>\n\n\n\n<p>Compte tenu de ces éléments, l’extension <a href=\"https://fr.wordpress.org/plugins/enable-jquery-migrate-helper/\">Enable jQuery Migrate Helper</a> a été mise à jour pour la sortie de WordPress 5.6, afin que votre site puisse continuer à utiliser les anciennes versions de jQuery en cas de besoin.</p>\n\n\n\n<p class=\"has-background has-medium-font-size\" style=\"background-color:#b4d9dd\">Nous vous conseillons donc d&rsquo;installer (ou si vous l&rsquo;avez déjà, de conserver) l’extension Enable jQuery Migrate Helper sur votre site lors de votre passage à WordPress 5.6.</p>\n\n\n\n<p>Cette solution doit cependant être considérée comme étant provisoire, car les anciennes versions de jQuery ne reçoivent plus de mises à jour de sécurité, et qu&rsquo;elles pourront donc à l&rsquo;avenir compromettre la sécurité de votre site.</p>\n\n\n\n<h2>Présentation de l&rsquo;extension <em>Enable jQuery Migrate Helper</em></h2>\n\n\n\n<p>Cette extension propose des fonctionnalités et des outils permettant de passer d&rsquo;une version de jQuery à une autre, soit par le biais d&rsquo;une mise à jour du code des extensions ou des thèmes par leurs auteurs, soit en donnant au propriétaire du site le temps de trouver des alternatives.</p>\n\n\n\n<h3>Remontée des éléments posant problème</h3>\n\n\n\n<p>L&rsquo;extension permet de détecter les problèmes rencontrés sur votre site&nbsp;: lorsque vous naviguez sur votre site avec l&rsquo;extension active, elle identifie les dépréciations relatives à du code jQuery obsolète et vous les affiche, si vous être connecté·e avec votre compte d&rsquo;administration du site.</p>\n\n\n\n<p>Les dépréciations sont des avertissements liés à une utilisation de code obsolète, mais qui sera encore pris en charge pendant une période de transition. Toute fonctionnalité marquée comme étant dépréciée doit être remplacée par du code moderne dès que possible, afin de s&rsquo;assurer que tout fonctionne correctement sur le long terme.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Tableau-de-bord-‹-WordPress-Trunk-—-WordPress.png\"><img loading=\"lazy\" width=\"920\" height=\"32\" src=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Tableau-de-bord-‹-WordPress-Trunk-—-WordPress.png\" alt=\"\" class=\"wp-image-1837\" srcset=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Tableau-de-bord-‹-WordPress-Trunk-—-WordPress.png 920w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Tableau-de-bord-‹-WordPress-Trunk-—-WordPress-300x10.png 300w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Tableau-de-bord-‹-WordPress-Trunk-—-WordPress-768x27.png 768w\" sizes=\"(max-width: 920px) 100vw, 920px\" /></a><figcaption><small>Ci-dessus, la barre d&rsquo;administration affichant les avertissements de dépréciation. Cliquez sur l&rsquo;image pour l&rsquo;ouvrir en taille originale dans un nouvel onglet.</small></figcaption></figure>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<p>Le premier emplacement où vous rencontrerez ces avertissements de dépréciations sera la barre d&rsquo;administration située en haut de page lorsque vous êtes connecté·e en tant qu&rsquo;administrateur ou administratrice.</p>\n\n\n\n<p>Vous y trouverez le nombre de problèmes rencontrés sur la page courante. Les avertissements de dépréciations sur la partie publique du site sont enregistrés et visualisables sur une page dédiée à cela et uniquement visible par les admins. Sur l&rsquo;interface d&rsquo;administration, les avertissements sont directement affichés à l&rsquo;écran, et sont également enregistrés, la configuration choisie au niveau des réglages de l&rsquo;extension.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-large\"><a href=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Outils-‹-WordPress-Trunk-—-WordPress.png\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" width=\"160\" height=\"274\" src=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-Outils-‹-WordPress-Trunk-—-WordPress.png\" alt=\"\" class=\"wp-image-1838\" /></a></figure></div>\n\n\n\n<p>Si des dépréciations ont déjà été enregistrées, elles peuvent également afficher dans le menu d’administration un indicateur du nombre d&rsquo;éléments enregistrés comme le montre la capture d&rsquo;écran ci-contre.</p>\n\n\n\n<p>Ces éléments resteront marqués jusqu&rsquo;à ce que vous effaciez les enregistrements concernés.</p>\n\n\n\n<figure class=\"wp-block-image size-full\"><a href=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress.png\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" width=\"1152\" height=\"368\" src=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress.png\" alt=\"\" class=\"wp-image-1839\" srcset=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress.png 1152w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress-300x96.png 300w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress-1024x327.png 1024w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress-768x245.png 768w\" sizes=\"(max-width: 1152px) 100vw, 1152px\" /></a><figcaption><small>Ci-dessus, un aperçu des journaux de dépréciations, avec des exemples d&rsquo;extensions contenant du code déprécié. Cliquez sur l&rsquo;image pour l&rsquo;afficher en grand dans un nouvel onglet.</small></figcaption></figure>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<p>La page du journal des dépréciations permet d’avoir dans la console JavaScript une représentation visuelle des avertissements souvent cachés et destinés aux développeurs et développeuses.</p>\n\n\n\n<p>Elle contient aussi un lien direct vers le site web de l’extension ou du thème, ou vers le site de la personne qui développe l&rsquo;extension ou le thème, si aucun autre lien n&rsquo;est disponible. Ce type d&rsquo;accès direct aidera, nous l&rsquo;espérons, les utilisateurs et utilisatrices de WordPress à obtenir des versions mises à jour ou à remonter les problèmes rencontrés aux développeurs et développeuses d&rsquo;extensions et de thèmes.</p>\n\n\n\n<h2>Basculer sur l&rsquo;ancienne version de jQuery</h2>\n\n\n\n<figure class=\"wp-block-image size-full\"><a href=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1.png\"><img loading=\"lazy\" width=\"1181\" height=\"471\" src=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1.png\" alt=\"\" class=\"wp-image-1841\" srcset=\"https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1.png 1181w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1-300x120.png 300w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1-1024x408.png 1024w, https://fr.wordpress.org/files/2020/12/Screenshot_2020-12-07-jQuery-Migrate-‹-WordPress-Trunk-—-WordPress1-768x306.png 768w\" sizes=\"(max-width: 1181px) 100vw, 1181px\" /></a><figcaption><small>La page de réglages de l&rsquo;extension, avec les options pour changer les versions de jQuery. Cliquer sur l&rsquo;image pour l&rsquo;ouvrir en grand dans un nouvel onglet.</small></figcaption></figure>\n\n\n\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<p>La page des réglages de l&rsquo;extension permet aux administrateurs et administratrices de sites de choisir entre l&rsquo;utilisation de l&rsquo;ancienne version de jQuery (avec un avertissement visible par les admins sur chaque page avec les erreurs remontées), et une option permettant d&rsquo;activer l&rsquo;enregistrement des dépréciations générées par les personnes visitant le site (option nommée «&nbsp;journalisation publique&nbsp;»).</p>\n\n\n\n<p>La journalisation publique peut entraîner une charge supplémentaire sur votre serveur, car toute personne qui consulte une page présentant des erreurs générera automatiquement une nouvelle entrée dans le journal des erreurs. Cette option n&rsquo;est a activer que si le support de WordPress ou d&rsquo;une extension vous le demande</p>\n\n\n\n<h3>Changement automatique de version de jQuery</h3>\n\n\n\n<p>Nous sommes conscients que le public cible du logiciel WordPress est largement constitué de personnes n&rsquo;ayant pas forcément les connaissances techniques permettant de prendre les bonnes décisions.</p>\n\n\n\n<p>C&rsquo;est pourquoi un mécanisme automatisé a été mis en place sur l&rsquo;extension <em>Enable jQuery Migrate Helper</em> afin de basculer automatiquement sur l&rsquo;ancienne version de jQuery dans le cas où le site ne serait pas fonctionnel sur la nouvelle version. Un e-mail de notification sera alors envoyé au propriétaire du site pour l&rsquo;informer de cela.</p>\n\n\n\n<h2>Envoi de notifications e-mail automatisées</h2>\n\n\n\n<figure class=\"wp-block-image size-full\"><a href=\"https://fr.wordpress.org/files/2020/12/image-6.png\"><img loading=\"lazy\" width=\"1643\" height=\"471\" src=\"https://fr.wordpress.org/files/2020/12/image-6.png\" alt=\"\" class=\"wp-image-1843\" srcset=\"https://fr.wordpress.org/files/2020/12/image-6.png 1643w, https://fr.wordpress.org/files/2020/12/image-6-300x86.png 300w, https://fr.wordpress.org/files/2020/12/image-6-1024x294.png 1024w, https://fr.wordpress.org/files/2020/12/image-6-768x220.png 768w, https://fr.wordpress.org/files/2020/12/image-6-1536x440.png 1536w\" sizes=\"(max-width: 1643px) 100vw, 1643px\" /></a><figcaption><small>Exemple de notification e-mail envoyée lors de l&rsquo;utilisation d&rsquo;une ancienne version de jQuery.</small></figcaption></figure>\n\n\n\n<p>Une fois par semaine, l&rsquo;extension enverra un e-mail à la personne chargée de l&rsquo;administration du site pour l&rsquo;informer de l&rsquo;état actuel de son site. Cette notification contient des informations sur les problèmes liés à jQuery qui ont été enregistrés au cours de la semaine écoulée.</p>\n\n\n\n<p>Nous espérons ainsi que les personnes chargées de l’administration de leur site pourront ainsi prendre en main la résolution des problèmes touchant leur site, notamment en mettant à jour les extensions et thèmes générant des erreurs sur le site.</p>\n\n\n\n<p>Dans ces mêmes e-mails, nous encourageons également la suppression de l&rsquo;extension jQuery Migrate Helper si aucune dépréciation n&rsquo;a été enregistrée au cours de la semaine écoulée. Cela permettra aux équipes de WordPress.org d&rsquo;avoir un aperçu en temps réel des problèmes de compatibilité jQuery, en observant le nombre d&rsquo;installations actives de l&rsquo;extension.</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Si vous avez des questions ou si vous avez besoin d&rsquo;aide, n&rsquo;hésitez pas à vous inscrire sur le <a href=\"https://wpfr.net/support\">forum d&rsquo;entraide de l&rsquo;association WordPress Francophone</a> ou à <a href=\"https://wpfr.net/slack\">rejoindre le Slack WordPress-Fr</a>.</p>\n\n\n\n<p>Cet article est une traduction par <a href=\'https://profiles.wordpress.org/justinahinon/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>justinahinon</a> de l’article <em><a href=\"https://make.wordpress.org/support/2020/12/handling-potential-jquery-issues-in-wordpress-5-6/\">Handling potential jQuery issues in WordPress 5.6</a></em><a href=\"https://make.wordpress.org/support/2020/12/handling-potential-jquery-issues-in-wordpress-5-6/\"> (article en anglais)</a>, initialement publié par <a href=\'https://profiles.wordpress.org/clorith/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>clorith</a> sur le blog de développement du cœur WordPress. Relu et adapté par <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a> et <a href=\'https://profiles.wordpress.org/fxbenard/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>fxbenard</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://fr.wordpress.org/2020/12/07/gestion-des-problemes-potentiels-lies-a-la-mise-a-jour-de-jquery-dans-wordpress-5-6/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"WordPress 5.6 : des changements visant à améliorer l’inclusivité de l’interface d’administration\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:128:\"https://fr.wordpress.org/2020/11/26/wordpress-5-6-des-changements-visant-a-ameliorer-linclusivite-de-linterface-dadministration/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:137:\"https://fr.wordpress.org/2020/11/26/wordpress-5-6-des-changements-visant-a-ameliorer-linclusivite-de-linterface-dadministration/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 26 Nov 2020 08:41:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Traduction\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1801\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:379:\"Depuis maintenant quelques années, l’équipe de traduction de WordPress en français vise à rendre la traduction de WP la plus inclusive possible, notamment sur les questions de genres. Cela s’ancre dans le positionnement plus global de WordPress en tant qu’écosystème, et se trouve finalement être le reflet des valeurs portées par ce projet open-source au [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress FR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11450:\"\n<p>Depuis maintenant quelques années, l’équipe de traduction de WordPress en français vise à rendre la traduction de WP la plus inclusive possible, notamment sur les questions de genres.</p>\n\n\n\n<p>Cela s’ancre dans le positionnement plus global de WordPress en tant qu’écosystème, et se trouve finalement être le reflet des valeurs portées par ce projet open-source au niveau mondial. Ces valeurs d’inclusivité et de promotion de la diversité se retrouvent lors des Meetups et WordCamps –&nbsp;les évènements rassemblant la communauté&nbsp;– tout comme au sein du projet. Citons notamment les prises de position sur des <a href=\"https://fr.wordpress.org/team/2020/07/21/retrait-des-termes-whitelist-et-blacklist-du-lexique-wordpress/\">points de terminologie</a> à la suite du mouvement Black Lives Matter, ou encore la décision de l’équipe <em>Core</em> du CMS d&rsquo;agir pour améliorer la représentation des femmes dans le logiciel libre et au sein de la «&nbsp;tech&nbsp;» en général, en nommant une équipe de direction 100% féminine (ou non-binaire) pour la version majeure 5.6 de WordPress.</p>\n\n\n\n<p>Après de nombreuses modifications de traduction ces dernières années, nous avons abouti il y a plus d’un an à une règle d’écriture, déjà appliquée de longue date dans la traduction française de WordPress, de ses extensions et de ses thèmes. L’objectif de cette règle était de remplacer les traductions utilisant le masculin uniquement par des traductions inclusives, c&rsquo;est-à-dire s’adressant à toutes et tous.</p>\n\n\n\n<p>L’équipe de traduction de WordPress comprend les réserves souvent portées sur la lisibilité de l’écriture basée sur l’usage du point médian. L’utilisation du point médian arrive donc en troisième position lorsqu’il s’agit de faire un choix de traduction. Pour rappel, voici l’ordre de préférence de l’équipe de traduction pour remplacer un terme uniquement masculin par une formulation plus inclusive&nbsp;:</p>\n\n\n\n<ol><li><strong>Formulation neutre<br></strong>Exemple&nbsp;: «&nbsp;Les personnes chargées de l’administration&nbsp;»</li><li><strong>Formulation combinée<br></strong>Exemple&nbsp;: «&nbsp;Les administrateurs et administratrices&nbsp;»</li><li><strong>Formulation basée sur l’usage du point médian<br></strong>Exemple&nbsp;:&nbsp;«&nbsp;Les administrateur·ice·s&nbsp;»</li></ol>\n\n\n\n<p>Cette règle est appliquée depuis longtemps sur WordPress. Mais il restait encore un point particulièrement complexe et «&nbsp;sensible&nbsp;» celui de l&rsquo;écran <em>«&nbsp;Utilisateurs&nbsp;»</em> de l’administration et des rôles liés à ces <em>«&nbsp;utilisateurs&nbsp;»</em>. Puisqu&rsquo;il s&rsquo;agissait des derniers emplacements de l’administration du logiciel où des termes uniquement masculins étaient utilisés pour qualifier les utilisateurs et utilisatrices de l’outil, nous avons mis en place avec l’ensemble de l’équipe de traduction une démarche visant à faire évoluer la terminologie employée sur cette interface.</p>\n\n\n\n<p>Cette démarche s’est répartie sur quatre réunions de l’équipe de traduction (comptes-rendus disponibles à la fin du présent article).</p>\n\n\n\n<span id=\"more-1801\"></span>\n\n\n\n<h2>Étude de faisabilité des différentes hypothèses identifiées</h2>\n\n\n\n<p>Nous avons identifié trois hypothèses principales&nbsp;:</p>\n\n\n\n<ul><li>Neutralisation de l’interface en utilisant des termes épicènes</li><li>Utilisation de formulations combinant masculin et féminin</li><li>Utilisation du point médian</li></ul>\n\n\n\n<p>Partant de là, nous avons réalisé une extension permettant de mettre à l’épreuve ces trois hypothèses directement dans le tableau de bord. Nous avons ensuite organisé une séance en visioconférence avec l’équipe de traduction afin d’évaluer le rendu de chaque solution.</p>\n\n\n\n<p>Le compte rendu de cette étude de faisabilité est disponible dans les liens situés à la fin du présent article.</p>\n\n\n\n<h2>Décision finale de modification de traduction</h2>\n\n\n\n<p>Suite à cette étude de faisabilité, la réunion suivante de l’équipe de traduction a permis d’aboutir à la décision finale quant à ces changements de traduction.</p>\n\n\n\n<ul><li>Le terme «&nbsp;utilisateur&nbsp;» est remplacé par «&nbsp;compte&nbsp;» (formulation épicène)</li><li>Le nom de chaque rôle (administrateur, éditeur, auteur, contributeur, abonné) est remplacé par une combinaison du terme masculin et du terme féminin.<ul><li>Si la combinaison est faite au sein d’une phrase, la forme longue est privilégiée&nbsp;: «&nbsp;Un e-mail sera envoyé sur l&rsquo;adresse de messagerie de l’utilisatrice ou de l’utilisateur&nbsp;»</li><li>Si la combinaison est faite sur le rôle affiché seul, une forme courte est privilégiée (de préférence sans utiliser le point médian)&nbsp;: «&nbsp;éditeur/éditrice&nbsp;».</li><li>Concernant le choix de l’ordre entre le terme féminin et masculin, il a été décidé d’ordonner les rôles dans l’ordre alphabétique.</li></ul></li><li>Suivant les besoins et en fonction du contexte de la phrase, une formulation neutre peut être jugée appropriée. Par exemple, <em>«&nbsp;Vous pouvez activer l’affichage des avatars des visiteurs qui laissent un commentaire sur votre site&nbsp;»</em> est traduit par <em>«&nbsp;Vous pouvez activer l’affichage des avatars des personnes qui laissent un commentaire sur votre site&nbsp;»</em>.</li></ul>\n\n\n\n<h2>Phase d’implémentation de la modification de traduction</h2>\n\n\n\n<p>Nous avons ensuite procédé à l’implémentation de ces modifications dans la traduction de WordPress en français. Pour cela nous avons effectué nos traductions sur <em>TranslationPress</em>, un outil gracieusement mis à disposition par la société <em>WP-Translations</em>. Cet outil nous a permis de préparer l’ensemble des modifications sans altérer les paquets de traductions générés par <em>translate.wordpress.org</em>, mais aussi –&nbsp;et surtout&nbsp;– de tester ces modifications directement sur le tableau de bord afin de pouvoir nous assurer d’identifier les éléments de l’interface potentiellement problématiques.</p>\n\n\n\n<p>Une fois les modifications implémentées et testées, nous avons importé ces traductions dans la branche 5.6 de WordPress. En effet, cette modification ne sera portée que sur les versions égales ou supérieures à WordPress 5.6.</p>\n\n\n\n<p>Maintenant que ces changements ont été implémentés dans le cœur WordPress, il va être nécessaire de les porter au sein de l’écosystème, c&rsquo;est à dire dans les thèmes et les extensions. Cela sera fait progressivement pendant les prochaines semaines.</p>\n\n\n\n<h3>Captures d’écrans des principaux changements</h3>\n\n\n\n<p><strong>Écran de liste des comptes (anciennement liste des utilisateurs)&nbsp;:</strong></p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste.png\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" width=\"1024\" height=\"591\" src=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-1024x591.png\" alt=\"\" class=\"wp-image-1804\" srcset=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-1024x591.png 1024w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-300x173.png 300w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-768x443.png 768w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-1536x887.png 1536w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-liste-2048x1182.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a><figcaption><em><small>Cliquer sur l&rsquo;image pour l&rsquo;ouvrir en taille réelle dans un nouvel onglet</small></em></figcaption></figure>\n\n\n\n<p><strong>Écran d’ajout d’un compte (anciennement ajout d’un utilisateur)&nbsp;:</strong></p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout.png\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" width=\"1024\" height=\"758\" src=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-1024x758.png\" alt=\"\" class=\"wp-image-1803\" srcset=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-1024x758.png 1024w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-300x222.png 300w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-768x568.png 768w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-1536x1136.png 1536w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-comptes-ajout-2048x1515.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a><figcaption><em><small>Cliquer sur l&rsquo;image pour l&rsquo;ouvrir en taille réelle dans un nouvel onglet</small></em></figcaption></figure>\n\n\n\n<p><strong>Écran d’exportation des données privées (utilisation d’une combinaison utilisateur/utilisatrice)&nbsp;:</strong></p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison.png\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" width=\"1024\" height=\"253\" src=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison-1024x253.png\" alt=\"\" class=\"wp-image-1802\" srcset=\"https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison-1024x253.png 1024w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison-300x74.png 300w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison-768x190.png 768w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison-1536x379.png 1536w, https://fr.wordpress.org/files/2020/11/changements-wordpress-francais-epicene-combinaison.png 2002w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a><figcaption><em><small>Cliquer sur l&rsquo;image pour l&rsquo;ouvrir en taille réelle dans un nouvel onglet</small></em></figcaption></figure>\n\n\n\n<h2>Liens vers les comptes-rendus de l’équipe de traduction</h2>\n\n\n\n<ul><li><a href=\"https://fr.wordpress.org/team/2020/09/08/compte-rendu-de-la-37eme-reunion-du-7-septembre-2020/\">7 septembre 2020&nbsp;: Lancement du travail</a></li><li><a href=\"https://fr.wordpress.org/team/2020/10/07/compte-rendu-de-la-38eme-reunion-du-6-octobre-2020/\">6 octobre 2020&nbsp;: Lancement des extensions de bêta test</a></li><li><a href=\"https://fr.wordpress.org/team/2020/11/01/compte-rendu-de-latelier-detude-de-faisabilite-des-changements-de-traduction-concernant-les-profils-utilisateurs-et-leurs-roles/\">15 octobre 2020&nbsp;: Étude de faisabilité en visio-conférence</a></li><li><a href=\"https://fr.wordpress.org/team/2020/11/03/compte-rendu-de-la-39eme-reunion-du-2-novembre-2020/\">2 novembre 2020&nbsp;: Décision finale et lancement de la phase d’implémentation</a></li></ul>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:133:\"https://fr.wordpress.org/2020/11/26/wordpress-5-6-des-changements-visant-a-ameliorer-linclusivite-de-linterface-dadministration/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"17\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"Les changements techniques à venir sur WordPress 5.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://fr.wordpress.org/2020/11/24/les-changements-techniques-a-venir-sur-wordpress-5-6/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://fr.wordpress.org/2020/11/24/les-changements-techniques-a-venir-sur-wordpress-5-6/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 24 Nov 2020 10:28:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1766\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:434:\"En tant qu&#8217;utilisateurs et utilisatrices de WordPress, vous allez voir arriver dans WordPress 5.6 la mise à jour automatique des versions majeures du cœur WP. Ces mises à jour seront activables ou désactivables manuellement dans l&#8217;interface d&#8217;administration. L’API REST de WordPress proposera également l&#8217;authentification externe à l&#8217;aide de la nouvelle fonctionnalité de mots de passe [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:33008:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2020/11/wp-5-6-banniere.png\"><img loading=\"lazy\" width=\"1024\" height=\"586\" src=\"https://fr.wordpress.org/files/2020/11/wp-5-6-banniere-1024x586.png\" alt=\"\" class=\"wp-image-1780\" srcset=\"https://fr.wordpress.org/files/2020/11/wp-5-6-banniere-1024x586.png 1024w, https://fr.wordpress.org/files/2020/11/wp-5-6-banniere-300x172.png 300w, https://fr.wordpress.org/files/2020/11/wp-5-6-banniere-768x440.png 768w, https://fr.wordpress.org/files/2020/11/wp-5-6-banniere-1536x879.png 1536w, https://fr.wordpress.org/files/2020/11/wp-5-6-banniere.png 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<div class=\"wp-block-group has-background\" style=\"background-color:#d0e3db\"><div class=\"wp-block-group__inner-container\">\n<div style=\"height:24px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:2%\">\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\" style=\"flex-basis:96%\">\n<p class=\"has-medium-font-size\"><strong>La sortie de&nbsp;WordPress 5.6&nbsp;est prévue le 8 décembre 2020 !&nbsp;<img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f384.png\" alt=\"🎄\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></strong></p>\n\n\n\n<p>L&rsquo;équipe de direction de cette nouvelle version majeure de WordPress est <em>intégralement</em> constituée de femmes ou de personnes non-binaires. L&rsquo;objectif est de valoriser la place des femmes dans les postes de direction au sein d&rsquo;un écosystème open-source (et <em>IT</em> d&rsquo;une manière générale) bien souvent encore très masculin.</p>\n\n\n\n<p>À l&rsquo;orée des 39&nbsp;% de parts de marché sur les systèmes de gestion de contenus web dans le monde, le logiciel libre et open-source WordPress entend ainsi contribuer à sa manière à réduire les inégalités qui pèsent sur le monde de la <em>tech</em>, notamment sur les postes de direction. WordPress poursuit par ailleurs sa politique de promotion de la diversité dans son ensemble, entreprise depuis plusieurs années.</p>\n\n\n\n<p class=\"has-text-align-center has-medium-font-size\"><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-200d-1f4bb.png\" alt=\"👩‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3fb-200d-1f4bb.png\" alt=\"👩🏻‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3fc-200d-1f4bb.png\" alt=\"👩🏼‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3fd-200d-1f4bb.png\" alt=\"👩🏽‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3fe-200d-1f4bb.png\" alt=\"👩🏾‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f469-1f3ff-200d-1f4bb.png\" alt=\"👩🏿‍💻\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n</div>\n\n\n\n<div class=\"wp-block-column\" style=\"flex-basis:2%\"></div>\n</div>\n</div></div>\n\n\n\n<p>En tant qu&rsquo;utilisateurs et utilisatrices de WordPress, vous allez voir arriver dans WordPress 5.6 la mise à jour automatique des versions majeures du cœur WP. Ces mises à jour seront activables ou désactivables manuellement dans l&rsquo;interface d&rsquo;administration. L’API REST de WordPress proposera également l&rsquo;authentification externe à l&rsquo;aide de la nouvelle fonctionnalité de mots de passe d&rsquo;applications, la prise en charge de PHP 8, les dernières fonctionnalités développées dans l&rsquo;éditeur de blocs, et un nouveau thème par défaut qui proposera nativement une conformité aux Règles d&rsquo;accessibilité pour les contenus web (WCAG) 2.1 niveau AAA.</p>\n\n\n\n<p>En tant que développeur ou développeuse, vous trouverez dans WP 5.6 plus de&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=enhancement&amp;type=feature+request&amp;milestone=5.6&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">85 améliorations et nouvelles fonctionnalités and feature requests</a> et plus de&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=defect+(bug)&amp;milestone=5.6&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">200 corrections de bugs</a>.</p>\n\n\n\n<p>Bien entendu, tout cela induit des changements de code dans le cœur du CMS, ce qui pourrait vous demander d’effectuer des modifications dans le code de votre site, de vos thèmes ou de vos extensions.</p>\n\n\n\n<p>Dans cet article, nous nous concentrerons justement sur les changements techniques majeurs de cette nouvelle version. Les articles liés sont tous en anglais, ce guide ayant pour objet de donner une synthèse en français.</p>\n\n\n\n<span id=\"more-1766\"></span>\n\n\n\n<h2>Mots de passe d’applications</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?component=Login+and+Registration&amp;milestone=5.6&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">8 mises à jour du composant <em>Login and Registration</em></a>, il est important de noter plusieurs changements d&rsquo;ampleur sur l&rsquo;API WordPress détaillés dans le guide d’implémentation de l&rsquo;API Application Passwords. Vous pouvez désormais réaliser des requêtes authentifiées sur diverses API WordPress avec cette nouvelle fonctionnalité.</p>\n\n\n\n<p>Le guide d&rsquo;implémentation comprend des détails sur le format des mots de passe d&rsquo;application, le catalogue de données complet de la fonctionnalité, des explications sur la manière de générer des identifiants manuellement ou avec du code, et des détails sur la façon d’utiliser ces identifiants avec l&rsquo;API REST ou l’API XML-RPC. De plus, des indications y sont données concernant les développements à venir de l&rsquo;API REST.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"9SpdbpppZQ\"><a href=\"https://make.wordpress.org/core/2020/11/05/application-passwords-integration-guide/\">Application Passwords: Integration Guide</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Application Passwords: Integration Guide&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/05/application-passwords-integration-guide/embed/#?secret=9SpdbpppZQ\" data-secret=\"9SpdbpppZQ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Mises à jour automatiques</h2>\n\n\n\n<p>L’équipe <em>Core Auto-updates</em> de WordPress a travaillé sur une nouvelle interface permettant aux administrateurs et administratrices de sites d’activer les mises à jour automatiques pour toutes les nouvelles versions de WordPress, y compris les versions majeures. Les mises à jour automatiques pour les versions majeures seront désactivées par défaut pour les installations existantes et activées sur les nouvelles installations. Le réglage de la fonctionnalité peut se faire manuellement sur Tableau de bord&nbsp;&gt;&nbsp;Mises à jour ou peut être forcé via un filtre ou une constante.</p>\n\n\n\n<p>Lisez cette note de développement pour en savoir davantage sur la nouvelle interface, sur son fonctionnement, sur les constantes et filtres permettant de forcer ces réglages et sur les possibilités d&rsquo;extension de cette fonctionnalité.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Ao0kHgxiJU\"><a href=\"https://make.wordpress.org/core/2020/11/24/core-major-versions-auto-updates-ui-changes-in-wordpress-5-6-correction/\">Core major versions auto-updates UI changes in WordPress 5.6 – Correction</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Core major versions auto-updates UI changes in WordPress 5.6 – Correction&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/24/core-major-versions-auto-updates-ui-changes-in-wordpress-5-6-correction/embed/#?secret=Ao0kHgxiJU\" data-secret=\"Ao0kHgxiJU\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Éditeur / Gutenberg</h3>\n\n\n\n<p>Le développement de l’éditeur a continué son évolution rapide depuis la version 5.0 de WordPress. Aujourd’hui, la version 9.2 de Gutenberg a été intégrée dans WordPress 5.6, ce qui fait sept versions de Gutenberg de différence avec la version qui avait été intégrée dans WordPress 5.5 en août dernier&nbsp;! WordPress 5.5 comprend donc les versions&nbsp;<a href=\"https://make.wordpress.org/core/2020/07/22/whats-new-in-gutenberg-july-22/\">8.6</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/08/05/whats-new-in-gutenberg-august-5/\">8.7</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/08/19/whats-new-in-gutenberg-august-19/\">8.8</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/09/03/whats-new-in-gutenberg-2-september/\">8.9</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/09/16/whats-new-in-gutenberg-16-september/\">9.0</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2020/10/01/whats-new-in-gutenberg-30-september/\">9.1</a>, and&nbsp;<a href=\"https://make.wordpress.org/core/2020/10/21/whats-new-in-gutenberg-21-october/\">9.2</a>, mais aussi des correctifs et des améliorations de performance ayant été faits sur les versions&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/04/whats-new-in-gutenberg-4-november/\">9.3</a>&nbsp;and&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">9.4</a> de Gutenberg.</p>\n\n\n\n<p>L’annonce de sortie de&nbsp;<a href=\"https://wordpress.org/news/2020/07/wordpress-5-5-beta-1/\">WordPress 5.5 Beta 1 (en anglais)</a>&nbsp;met en évidence la plupart des nouvelles fonctionnalités et améliorations de ces différentes versions de Gutenberg. Notons particulièrement l&rsquo;utilisation de la vidéo dans les blocs Bannière, des améliorations sur les compositions de blocs, le décompte des caractères dans le panneau d&rsquo;informations, l&rsquo;amélioration de la navigation au clavier et une interface améliorée pour la fonctionnalité de glisser-déposer.</p>\n\n\n\n<p>Ci-dessous, vous trouverez des détails sur la nouvelle version de l’API Block qui permet désormais aux blocs de définir leur propre élément parent, et une nouvelle API&nbsp;<code>createBlocksFromInnerBlocksTemplate</code>&nbsp;pour créer des blocs à partir du modèle&nbsp;<code>InnerBlocks</code>. Vous verrez également le support de nouveaux blocs et de nouvelles possibilités pour les blocs dynamiques. Des améliorations d&rsquo;accessibilité et d&rsquo;utilisabilité on en outre été faites dans l&rsquo;éditeur, et les blocs réutilisables ont été extraits du composant <code>@wordpress/editor</code>&nbsp;vers le composant&nbsp;<code>@wordpress/reusable-blocks</code>&nbsp;afin de rendre disponibles les blocs réutilisables dans d&rsquo;autres éditeurs. Des changements ont également été faits sur les composants&nbsp;<code>Toolbar</code>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"sMrKOQHkcC\"><a href=\"https://make.wordpress.org/core/2020/11/18/block-api-version-2/\">Block API version 2</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block API version 2&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/block-api-version-2/embed/#?secret=sMrKOQHkcC\" data-secret=\"sMrKOQHkcC\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"CszCYhJyZ6\"><a href=\"https://make.wordpress.org/core/2020/11/18/new-createblocksfrominnerblockstemplate-block-api/\">New createBlocksFromInnerBlocksTemplate Block API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New createBlocksFromInnerBlocksTemplate Block API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/new-createblocksfrominnerblockstemplate-block-api/embed/#?secret=CszCYhJyZ6\" data-secret=\"CszCYhJyZ6\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"gst1jxct70\"><a href=\"https://make.wordpress.org/core/2020/11/18/block-supports-in-wordpress-5-6/\">Block Supports In WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block Supports In WordPress 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/block-supports-in-wordpress-5-6/embed/#?secret=gst1jxct70\" data-secret=\"gst1jxct70\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"uuBaNhmzJs\"><a href=\"https://make.wordpress.org/core/2020/11/18/editor-styling-changes-in-wordpress-5-6/\">Editor styling changes in WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Editor styling changes in WordPress 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/editor-styling-changes-in-wordpress-5-6/embed/#?secret=uuBaNhmzJs\" data-secret=\"uuBaNhmzJs\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"iqTosbm2ke\"><a href=\"https://make.wordpress.org/core/2020/11/18/reusable-blocks-extracted-into-a-separate-package/\">Reusable Blocks extracted into a separate package</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Reusable Blocks extracted into a separate package&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/reusable-blocks-extracted-into-a-separate-package/embed/#?secret=iqTosbm2ke\" data-secret=\"iqTosbm2ke\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3elHbDK13d\"><a href=\"https://make.wordpress.org/core/2020/11/18/changes-to-toolbar-components-in-wordpress-5-6/\">Changes to Toolbar components in WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to Toolbar components in WordPress 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/18/changes-to-toolbar-components-in-wordpress-5-6/embed/#?secret=3elHbDK13d\" data-secret=\"3elHbDK13d\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Poursuite de la migration de la version de jQuery</h3>\n\n\n\n<p>WordPress 5.6 comprend la partie 2 du plan en 3 étapes pour <a href=\"https://make.wordpress.org/core/2020/06/29/updating-jquery-version-shipped-with-wordpress/\">mettre à jour la version de jQuery comprise dans le cœur WordPress</a>. La deuxième étape de ce plan est la mise à jour de jQuery vers la version 3.5.1 et de jQuery Migrate vers la version 3.3.1. La note de développement ci-dessous inclut des détails sur cette partie 2 de ce plan, qui est prévu pour être terminé dans WordPress 5.7 au premier trimestre 2021.</p>\n\n\n\n<p>Comme WordPress 5.6 comprend une mise à jour majeure de la bibliothèque jQuery, il a été proposé aux développeurs et développeuses d&rsquo;extensions et de thèmes (via des notes de développement et même par e-mail) de tester leurs produits et services autant que possible, et de les mettre à jour si besoin pour éviter toute casse sur les sites les utilisant. </p>\n\n\n\n<p>En tant que propriétaire de site, vous pouvez lancer&nbsp;<a href=\"https://fr.wordpress.org/plugins/wp-jquery-update-test/\">l’extension de test de mise à jour</a>&nbsp;pour vérifier par avance d’éventuelles erreurs sur vos sites.</p>\n\n\n\n<p>Si vous rencontrez des problèmes d’affichage sur votre site (par exemple un diaporama qui ne fonctionne plus, un bouton qui n’a aucun effet), installez&nbsp;<a href=\"https://fr.wordpress.org/plugins/enable-jquery-migrate-helper/\">l’extension jQuery Migrate</a>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"C2IHWXIwAX\"><a href=\"https://make.wordpress.org/core/2020/11/05/updating-core-jquery-to-version-3-part-2/\">Updating core jQuery to version 3 &#8211; part 2</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updating core jQuery to version 3 &#8211; part 2&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/05/updating-core-jquery-to-version-3-part-2/embed/#?secret=C2IHWXIwAX\" data-secret=\"C2IHWXIwAX\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Prise en charge de PHP&nbsp;8</h3>\n\n\n\n<p>La nouvelle version majeure de PHP, la version 8.0.0 est sortie et le projet WordPress a une longue histoire concernant le fait de présenter la meilleure compatibilité possible avec les nouvelles versions de PHP, le plus tôt possible. Comme PHP 8 est une version majeure, cette version de PHP peut casser des choses qui fonctionnaient auparavant. Même si tous les soucis liés au cœur WordPress sont corrigés, il y a des chances que vos extensions et vos thèmes ne soient pas compatibles. Il est donc nécessaire de vérifier la compatibilité PHP&nbsp;8 de l&rsquo;ensemble de vos thèmes et extensions avant de mettre à jour la version de PHP sur votre serveur. Vous en saurez davantage sur cette note de développement&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zPzosvlS2S\"><a href=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/\">WordPress and PHP 8.0</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress and PHP 8.0&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/23/wordpress-and-php-8-0/embed/#?secret=zPzosvlS2S\" data-secret=\"zPzosvlS2S\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>API REST</h3>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=REST+API&amp;milestone=5.6&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">28 modifications sur l’API REST</a>, vous porterez une attention particulière au nouveau cadre de développement permettant d&rsquo;envoyer une série d&rsquo;appels à l&rsquo;API en une seule requête sur le serveur, ainsi qu&rsquo;à la nouvelle action <code>wp_after_insert_post</code>&nbsp;qui permet aux développeurs et développeuses de thèmes et d&rsquo;extensions de faire tourner du code sur-mesure après qu’une publication, un terme de taxonomie ou une méta-donnée a été mis à jour.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wLdnVAraKs\"><a href=\"https://make.wordpress.org/core/2020/11/20/rest-api-batch-framework-in-wordpress-5-6/\">REST API Batch Framework in WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;REST API Batch Framework in WordPress 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/20/rest-api-batch-framework-in-wordpress-5-6/embed/#?secret=wLdnVAraKs\" data-secret=\"wLdnVAraKs\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"jJVGFvazau\"><a href=\"https://make.wordpress.org/core/2020/11/20/new-action-wp_after_insert_post-in-wordpress-5-6/\">New action wp_after_insert_post in WordPress 5.6.</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New action wp_after_insert_post in WordPress 5.6.&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/20/new-action-wp_after_insert_post-in-wordpress-5-6/embed/#?secret=jJVGFvazau\" data-secret=\"jJVGFvazau\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Santé du site</h3>\n\n\n\n<p>Il y a&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=Site+Health&amp;milestone=5.6&amp;group=type&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">11 mises à jour du composant Santé du site</a>&nbsp;sur WordPress&nbsp;5.6. Notez particulièrement les améliorations sur la façon dont ce composant gère et valide les vérifications de santé du site. Tous ces changements sont listés dans la note de développement ci-dessous&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"JuTXAmaPm9\"><a href=\"https://make.wordpress.org/core/2020/11/15/site-health-check-changes-in-5-6/\">Site Health Check changes in 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Site Health Check changes in 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/15/site-health-check-changes-in-5-6/embed/#?secret=JuTXAmaPm9\" data-secret=\"JuTXAmaPm9\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Thèmes</h3>\n\n\n\n<p>Cette nouvelle version de WordPress poursuit la tradition de sortir un nouveau thème par défaut. Cette année, Twenty Twenty-One innove avec un thème présentant la meilleure conformité possible avec les Règles d&rsquo;accessibilité sur les contenus web (WCAG) version 2.1 au niveau&nbsp;<a href=\"https://www.w3.org/TR/UNDERSTANDING-WCAG20/conformance.html#uc-levels-head\">AAA</a>. Pour ce nouveau thème, notre équipe d&rsquo;experts en accessibilité a été inclue dans les décisions de design dès le début du projet, ce qui permet aujourd&rsquo;hui de présenter la meilleure conformité possible pour Twenty Twenty-One.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"dhrUOjijIp\"><a href=\"https://make.wordpress.org/core/2020/09/23/introducing-twenty-twenty-one/\">Introducing Twenty Twenty-One</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing Twenty Twenty-One&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/09/23/introducing-twenty-twenty-one/embed/#?secret=dhrUOjijIp\" data-secret=\"dhrUOjijIp\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Vous pouvez également consulter cet article en français&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-francais wp-block-embed-francais\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"kTx23780u5\"><a href=\"https://fr.wordpress.org/2020/09/25/twenty-twenty-one-le-theme-natif-de-wordpress-5-6/\">Twenty Twenty One, le thème natif de WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"« Twenty Twenty One, le thème natif de WordPress 5.6 » &#8212; Français\" src=\"https://fr.wordpress.org/2020/09/25/twenty-twenty-one-le-theme-natif-de-wordpress-5-6/embed/#?secret=kTx23780u5\" data-secret=\"kTx23780u5\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Autres mises à jour techniques</h3>\n\n\n\n<p>Mais ce n&rsquo;est pas tout&nbsp;! Vous pouvez également lire la note de développement ci-dessous pour en savoir davantage sur les changements à venir sur les composants suivants&nbsp;: Administration, Outils de <em>build</em>/test, Base de données, Médias, Multisite, Pings/trackbacks, Édition rapide et édition par lots, Santé du site, Taxonomies, Comptes, Mise à niveau et installation, Widgets, Gestion des erreurs PHP et JSON.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cjbR38ka4E\"><a href=\"https://make.wordpress.org/core/2020/11/20/miscellaneous-developer-focused-changes-in-wordpress-5-6/\">Miscellaneous developer focused changes in WordPress 5.6</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous developer focused changes in WordPress 5.6&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2020/11/20/miscellaneous-developer-focused-changes-in-wordpress-5-6/embed/#?secret=cjbR38ka4E\" data-secret=\"cjbR38ka4E\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Dans WordPress 5.6, plus de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.6&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">197 bugs</a>,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.6&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">85 améliorations et nouvelles fonctionnalités</a> et&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.6&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">39 tâches diverses</a>&nbsp;on été&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.6&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">marqués comme étant clôturés par WordPress 5.6</a>.</p>\n\n\n\n<p>Nous souhaitons également mettre en évidence quelques changements qui n’ont pas fait l’objet de notes de développement spécifiques (cliquez sur le numéro de ticket pour accéder au ticket en question sur Trac). Dans la liste ci-dessous, la description du ticket est conservée en anglais pour une meilleure traçabilité&nbsp;:</p>\n\n\n\n<ul><li>Bundled Theme: Added block patterns for Twenty Twenty (<a href=\"https://core.trac.wordpress.org/ticket/51098\">#51098</a>) and Twenty Nineteen (<a href=\"https://core.trac.wordpress.org/ticket/51099\">#51099</a>) themes.</li><li>Bundled Theme: Added theme support for navigation-widgets (see&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51445\">#51445</a>).</li><li>Build/Test Tools: Update&nbsp;<code>akismet</code>&nbsp;from&nbsp;<code>4.1.6</code>&nbsp;to&nbsp;<code>4.1.7</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51610\">#51610</a>).</li><li>Build/Test Tools: Composer 2.0 Support (<a href=\"https://core.trac.wordpress.org/ticket/51624\">#51624</a>).</li><li>Emoji: Update&nbsp;<code>twemoji</code>&nbsp;from&nbsp;<code>13.0.0</code>&nbsp;to&nbsp;<code>13.0.1</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51356\">#51356</a>).</li><li>External Libraries: Update&nbsp;<code>lodash</code>&nbsp;from&nbsp;<code>4.17.15</code>&nbsp;to&nbsp;<code>4.17.19</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51505\">#51505</a>).</li><li>External Libraries: Update&nbsp;<code>react</code>&nbsp;and&nbsp;<code>react-dom</code>&nbsp;from&nbsp;<code>16.9.0</code>&nbsp;to&nbsp;<code>16.13.1</code>&nbsp;(<a href=\"https://core.trac.wordpress.org/ticket/51505\">#51505</a>).</li><li>Media: Added indicator to image details for images attached to a site option (<a href=\"https://core.trac.wordpress.org/ticket/42063\">#42063</a>).</li><li>REST API: Fixed incorrect slashes in the&nbsp;URL&nbsp;if the parent is empty for REST API (see&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/44745\">#44745</a>).</li><li>Site Health: Added better handling of unexpected values in Site Health (<a href=\"https://core.trac.wordpress.org/ticket/50145\">#50145</a>).</li><li>Site Health: Added a test to Site Health to verify that the&nbsp;<code>Authorization</code>&nbsp;header&nbsp;is working as expected for Application Passwords (see&nbsp;<a href=\"https://core.trac.wordpress.org/ticket/51638\">#51638</a>).</li></ul>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.6 est prévue le 8 décembre 2020. Vous pouvez d’ores et déjà la tester en version&nbsp;<em>Release Candidate</em>&nbsp;en installant l’extension officielle <em>WordPress Beta Tester</em> puis en allant dans ses réglages et en cochant la case&nbsp;Beta/ version de développement puis en mettant à jour votre installation de façon classique.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-plugin-directory wp-block-embed-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SDmAZkDXE3\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"« WordPress Beta Tester » &#8212; Plugin Directory\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=SDmAZkDXE3\" data-secret=\"SDmAZkDXE3\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p><em>Merci à <a href=\'https://profiles.wordpress.org/bastho/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>bastho</a>, <a href=\'https://profiles.wordpress.org/wolforg/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>wolforg</a> et <a href=\'https://profiles.wordpress.org/fxbenard/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>fxbenard</a> pour leur relecture de cet article.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://fr.wordpress.org/2020/11/24/les-changements-techniques-a-venir-sur-wordpress-5-6/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Sortie de WordPress 5.5.3 : détails techniques importants\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://fr.wordpress.org/2020/10/31/sortie-de-wordpress-5-5-3-details-techniques-importants/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://fr.wordpress.org/2020/10/31/sortie-de-wordpress-5-5-3-details-techniques-importants/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 31 Oct 2020 09:53:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1731\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:368:\"Le 30 octobre 2020, la version 5.5.3 de WordPress est sortie, le jour suivant la sortie de la version 5.5.2. La sortie de deux nouvelles versions en moins de 24 heures d&#8217;écart est loin d’être une situation optimale, et elle n&#8217;est généralement pas voulue par l&#8217;équipe de développement de WordPress. Dans cet article, nous reviendrons [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7276:\"\n<p><strong>Le 30 octobre 2020, la version 5.5.3 de WordPress est sortie, le jour suivant la sortie de la version 5.5.2.</strong></p>\n\n\n\n<p>La sortie de deux nouvelles versions en moins de 24 heures d&rsquo;écart est loin d’être une situation optimale, et elle n&rsquo;est généralement pas voulue par l&rsquo;équipe de développement de WordPress.</p>\n\n\n\n<p>Dans cet article, nous reviendrons sur l&rsquo;incident ayant eu lieu sur WP 5.5.2, qui a entraîné également un autre incident complémentaire&nbsp;: certaines installations ont été mises à jour de façon intempestive vers une version de développement, WP 5.5.3-alpha. L&rsquo;objectif est de donner un retour objectif et transparent aux utilisatrices et utilisateurs de WordPress.</p>\n\n\n\n<h2>Résolution du problème de WP 5.5.2 et des installations via le fichier ZIP fourni sur WordPress.org</h2>\n\n\n\n<p>Un problème avec l’un des correctifs contenus dans WordPress 5.5.2 a entraîné un souci sur le fichier ZIP d&rsquo;installation disponible sur WordPress.org. Cette erreur était présente sur les fichiers d&rsquo;installation des versions 5.5.x, 5.4.x, 5.3.x, 5.2.x et 5.1.x. L&rsquo;installation de WordPress ne pouvait être réalisée via ces fichiers d&rsquo;installation à cause d&rsquo;une erreur de base de données. Ce problème n&rsquo;affectait en revanche «&nbsp;que&nbsp;» les procédures d&rsquo;installation n&rsquo;utilisant pas de fichier <code>wp-config.php</code> et utilisant l&rsquo;assistant d&rsquo;installation dans le navigateur.</p>\n\n\n\n<p>Lors de la publication de la version 5.5.2, le processus de test de l&rsquo;installation retourna un faux positif qui explique la non-détection du problème. Il s&rsquo;agit d&rsquo;un problème difficile à identifier mais notre première action sera déjà de mettre à jour la documentation existante pour que les futures équipes de direction de WordPress puissent tirer profit de cette expérience. Des recherches plus poussées seront nécessaires afin de trouver des solutions plus robustes sur le long terme. Les progrès réalisés sur ce point seront partagés sur des articles sur le <a href=\"https://make.wordpress.org/core\">blog de développement de l’équipe cœur de WordPress (en anglais)</a>.</p>\n\n\n\n<p>Pour corriger le problème, l’équipe de développement de WP a publié WordPress 5.5.3. Cette version fournit un fichier ZIP d&rsquo;installation pour chacune des autres versions de WordPress qui étaient affectées. Ainsi, ce sont 5 versions qui sont sorties le 30 octobre 2020&nbsp;: 5.5.3, 5.4.4, 5.3.6, 5.2.9 et 5.1.8.</p>\n\n\n\n<h2>Résolution du problème de la mise à jour automatique vers la version 5.5.3-alpha</h2>\n\n\n\n<p>Pendant le travail de préparation de WordPress 5.5.3, l’équipe chargée de l&rsquo;infrastructure WordPress.org a essayé de rendre la version 5.5.2 indisponible au téléchargement afin de limiter la portée du problème détaillé ci-dessus, puisqu&rsquo;il ne concernait que les nouvelles installations et pas les installations WordPress existantes. Cette action n&rsquo;était pas prévue dans les procédures de déploiement et de contrôle de mission et a entraîné malencontreusement certaines installations à être mises à jour vers une version de développement «&nbsp;5.5.3-alpha&nbsp;». Cette mise à jour automatique non désirée s&rsquo;est déroulée entre 16h30 et 17h (heure française) et a été stoppée dès que cela a été techniquement possible.</p>\n\n\n\n<p>Cette pseudo-version de développement était en fait strictement similaire à WordPress 5.5.2, excepté son numéro de version. Il n&rsquo;y a donc pas eu de conséquence pour l&rsquo;intégrité des sites concernés. Depuis la sortie de WordPress 5.5.3, l&rsquo;ensemble des sites qui étaient passés sur cette pseudo version 5.5.3-alpha ont été automatiquement mis à jour en version 5.5.3.</p>\n\n\n\n<p>La seule conséquence visible de ce souci a été – pour les sites concernés uniquement&nbsp;– l&rsquo;installation de l&rsquo;intégralité des thèmes natifs et l&rsquo;installation de l&rsquo;extension Akismet. Si vous êtes concerné, vous pouvez procéder à leur désinstallation et à leur suppression. L&rsquo;équipe de développement de WordPress est sincèrement désolée pour la gène occasionnée. Cela étant dit, ces thèmes et cette extension n&rsquo;étant pas actifs, cela n&rsquo;a pas eu de conséquence sur votre site.</p>\n\n\n\n<h2>En guise de conclusion</h2>\n\n\n\n<p>S&rsquo;il y a de nombreux processus améliorables pour pallier à ce type de situation – et nous avons à cœur de les améliorer – le déroulement de cette journée montre également l&rsquo;attachement de l&rsquo;équipe de développement de WordPress, répartie sur la planète entière, à se mobiliser pour trouver des solutions rapides lorsque des problèmes difficilement anticipables surviennent.</p>\n\n\n\n<p>Tout au long de cette fin de journée, l’équipe de développement s&rsquo;est efforcée d&rsquo;analyser la situation, d&rsquo;en tirer des conclusions, d&rsquo;agir puis enfin de communiquer de façon transparente sur ce qui s&rsquo;est passé. Les erreurs ayant donné lieu aux problématiques rencontrées ce vendredi ont été réparées aussitôt. Elles ont donné lieu à l&rsquo;identification d&rsquo;optimisations à réaliser sur les procédures de déploiement de nouvelles versions.</p>\n\n\n\n<p><strong>À aucun moment le moindre site WordPress n&rsquo;a été impacté au niveau fonctionnel</strong> et c&rsquo;est ce que nous souhaitons mettre en avant aujourd&rsquo;hui, car ce fut la préoccupation de l&rsquo;équipe tout au long de la journée.</p>\n\n\n\n<p>Merci à l&rsquo;équipe qui a travaillé pour résoudre cette situation&nbsp;: <a href=\"https://profiles.wordpress.org/whyisjake\"></a><a href=\"https://profiles.wordpress.org/whyisjake\">@whyisjake</a> (release lead 5.5.2), <a href=\"https://profiles.wordpress.org/audrasjb\">@audrasjb</a>, <a href=\"https://profiles.wordpress.org/barry/\">@barry</a>, <a href=\"https://profiles.wordpress.org/davidbaumwald\">@davidbaumwald</a>, <a href=\"https://profiles.wordpress.org/desrosj\">@desrosj</a>, <a href=\"https://profiles.wordpress.org/hellofromtonya\">@hellofromtonya</a>, <a href=\"https://profiles.wordpress.org/jeffpaul\">@jeffpaul</a>, <a href=\"https://profiles.wordpress.org/johnbillion\">@johnbillion</a>, <a href=\"https://profiles.wordpress.org/garubi\">@garubi</a>, <a href=\"https://profiles.wordpress.org/metalandcoffee\">@metalandcoffee</a>, <a href=\"https://profiles.wordpress.org/mukesh27\">@mukesh27</a>, <a href=\"https://profiles.wordpress.org/otto42/\">@otto42</a>, <a href=\"http://punitsoftac/\">@punitsoftac</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov\">@sergeybiryukov</a> et <a href=\"https://profiles.wordpress.org/xknown\">@xknown</a>.</p>\n\n\n\n<p>Vous pourrez retrouver des explications complémentaires avec les liens suivants&nbsp;:</p>\n\n\n\n<ul><li><a href=\"https://wordpress.org/news/2020/10/wordpress-5-5-3-maintenance-release/\">Annonce de sortie de WordPress 5.5.3 (en anglais)</a></li><li><a href=\"https://make.wordpress.org/core/2020/10/30/wordpress-5-5-3-release-some-technical-details/\">Détails techniques autour de la sortie de WP 5.5.3 (en anglais)</a></li></ul>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://fr.wordpress.org/2020/10/31/sortie-de-wordpress-5-5-3-details-techniques-importants/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"Questionnaire annuel 2020 sur votre utilisation de WordPress et résultats de l’enquête 2019\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:127:\"https://fr.wordpress.org/2020/10/28/questionnaire-annuel-2020-sur-votre-utilisation-de-wordpress-et-resultats-de-lenquete-2019/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:135:\"https://fr.wordpress.org/2020/10/28/questionnaire-annuel-2020-sur-votre-utilisation-de-wordpress-et-resultats-de-lenquete-2019/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 28 Oct 2020 09:25:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Questionnaires/sondages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1725\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:444:\"Le questionnaire 2020 Comme chaque année, l’équipe «&#160;Community&#160;» de WordPress lance son questionnaire à destination des utilisatrices et utilisateurs de WordPress afin de mieux les connaître et de comprendre leurs besoins. Comme l&#8217;année dernière, le questionnaire a été traduit en français. Ainsi, l’anglais n’est pas une barrière pour y répondre&#160;🙂 L&#8217;équipe Community de WordPress est [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2118:\"\n<h2>Le questionnaire 2020</h2>\n\n\n\n<p>Comme chaque année, l’équipe «&nbsp;Community&nbsp;» de WordPress lance son questionnaire à destination des utilisatrices et utilisateurs de WordPress afin de mieux les connaître et de comprendre leurs besoins.</p>\n\n\n\n<p>Comme l&rsquo;année dernière, le questionnaire a été traduit en français. Ainsi, l’anglais n’est pas une barrière pour y répondre&nbsp;<img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p class=\"has-small-font-size\">L&rsquo;équipe Community de WordPress est en revanche passée par une traduction automatique (pour des questions de temps) plutôt que par l&rsquo;équipe de traduction, ce qui occasionne quelques étrangetés dans certaines questions. Merci de vous montrer indulgents <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Nous ferons en sorte que la traduction soit manuelle l&rsquo;année prochaine&nbsp;!</p>\n\n\n\n<p>Cela ne vous prendra que quelques minutes, merci d’avance&nbsp;!</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-background\" href=\"https://wordpressdotorg.survey.fm/wordpress-2020-survey-french\" style=\"background-color:#0b679c\" target=\"_blank\" rel=\"noreferrer noopener\">Répondre au questionnaire</a></div>\n</div>\n\n\n\n<p>Les résultats du questionnaire seront publiés au premier trimestre 2021. Toutes les données personnelles sont anonymisées : les adresses e-mail et adresses IP sont automatiquement dissociées des données collectées. Pour en savoir plus, vous pouvez consulter notre&nbsp;<a href=\"https://fr.wordpress.org/about/privacy/\">politique de confidentialité</a>.</p>\n\n\n\n<h2>Les résultats de l&rsquo;enquête 2019</h2>\n\n\n\n<p>Vous pouvez <a href=\"https://docs.google.com/presentation/d/1FI7eEvSB5SHTSILIBpwOmH9rBffgD6mFnnqSkrEScYo/edit?usp=sharing\">consulter les résultats de l&rsquo;enquête 2019 en suivant ce lien (en anglais)</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:132:\"https://fr.wordpress.org/2020/10/28/questionnaire-annuel-2020-sur-votre-utilisation-de-wordpress-et-resultats-de-lenquete-2019/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:79:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"Participez au WordPress Translation Day FR en visioconférence le 03 octobre 2020 !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:117:\"https://fr.wordpress.org/2020/10/02/participez-au-wordpress-translation-day-fr-en-visioconference-le-03-octobre-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"https://fr.wordpress.org/2020/10/02/participez-au-wordpress-translation-day-fr-en-visioconference-le-03-octobre-2020/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Oct 2020 16:53:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"Contribuer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:10:\"Traduction\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1711\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:347:\"Toute la semaine aux quatre coins du globe, du Japon au Portugal en passant par de nombreux pays comme la Russie, l’Indonésie et bien d’autres les communautés de polyglottes du monde se sont réunies pour fêter la semaine de la traduction de WordPress. C’est maintenant à la communauté Francophone de se joindre à la fête… [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3326:\"\n<p>Toute la semaine aux quatre coins du globe, du Japon au Portugal en passant par de nombreux pays comme la Russie, l’Indonésie et bien d’autres les communautés de polyglottes du monde se sont réunies pour fêter la semaine de la traduction de WordPress. </p>\n\n\n\n<p>C’est maintenant à la communauté Francophone de se joindre à la fête… </p>\n\n\n\n<p>Le <strong>samedi 3 octobre 2020</strong>. Nous vous attendons polyglottes pour participer au mini-évènement de la <strong>Journée de la traduction de WordPress en France, </strong>sur Zoom et le Slack FR<strong>.</strong></p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://wpfr.net/files/2020/09/banniere.jpg\" alt=\"\" class=\"wp-image-2354256\" /></figure></div>\n\n\n\n<h2 id=\"comment-cela-va-t-il-se-derouler\">Comment cela va-t-il se passer&nbsp;?</h2>\n\n\n\n<p>C’est très simple&nbsp;: rendez-vous à partir de 13 heures sur la conférence Zoom. Si vous ne pouvez pas vous libérer dès 13 heures, n’hésitez pas à nous rejoindre en cours de route&nbsp;!</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-background\" href=\"https://us02web.zoom.us/webinar/register/WN_LOV3-RH7S32zT7deLcrEwQ\" style=\"border-radius:7px;background-color:#1d7ab0\">S’inscrire à la visioconférence Zoom</a></div>\n</div>\n\n\n\n<p>Durant cette après-midi de traduction 3 GTE (<em>General Translation Editors</em>) seront présents pour vous aider : Jenny Dupuy, FX Bénard et JB Audras.</p>\n\n\n\n<p>L’objectif est d’accueillir, orienter et accompagner un maximum de nouvelles personnes pour les initier à la traduction du cœur de WordPress, mais aussi des thèmes, des extensions et de la documentation relative au fonctionnement de ce CMS.</p>\n\n\n\n<p>Tout au long de l’après-midi les GTE accueilleront les personnes désireuses de participer et organiseront des mini-formations pour aider les personnes débutantes.</p>\n\n\n\n<p>Les personnes plus expérimentées pourront continuer ou commencer de traduire.</p>\n\n\n\n<h2 id=\"pourquoi-participer-et-que-traduire\">Pourquoi participer et que traduire&nbsp;?</h2>\n\n\n\n<p>La traduction est une manière de <strong>contribuer au projet Open Source WordPress</strong>. Il est plus agréable et plus compréhensible d’utiliser WordPress, une extension ou un thème dans notre langue maternelle. C’est aussi plus inclusif, car il existe des personnes ne parlant pas anglais <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Concernant ce que nous pouvons traduire, nous conseillons, en règle générale, de traduire des extensions, thèmes que nous avons toutes et tous l’habitude d’utiliser.</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-background\" href=\"https://us02web.zoom.us/webinar/register/WN_LOV3-RH7S32zT7deLcrEwQ\" style=\"border-radius:7px;background-color:#1d7ab0\">S’inscrire à la visioconférence Zoom</a></div>\n</div>\n\n\n\n<p>Nous vous attendons nombreuses et nombreux ! Alors rendez-vous sur le Slack de la communauté WordPress-fr : <a href=\"https://wpfr.net/slack/\">https://wpfr.net/slack/</a> puis dans le canal <strong>#wptranslationday</strong></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:122:\"https://fr.wordpress.org/2020/10/02/participez-au-wordpress-translation-day-fr-en-visioconference-le-03-octobre-2020/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://fr.wordpress.org/news/feed/\";s: